(503, 'Lycinais Jean', 'Lycinaïs JEAN (comme Billie Jean) est une jeune artiste autodidacte d''origine\r\n\r\nGuadeloupéenne et Martiniquaise.\r\n\r\nElle est née au sein d''une famille de musiciens. Pour ses 10 ans, son grand-père\r\n\r\nmaternel, lui-même guitariste, lui offre sa première guitare.\r\n\r\nComme ses proches, elle développe une passion pour la musique. Elle jongle\r\n\r\nalors entre la batterie, le clavier, la guitare et le chant, sans véritablement suivre\r\n\r\nde formation (sauf pour la batterie).\r\n\r\nAu cours de son adolescence, elle se produit dans des banquets et "Caf’ Conc’"\r\n\r\nen tant que guitariste du groupe Swing 7, créé par son parrain. Ils interprètent\r\n\r\ndes grands classiques, Zouk, variété française, ainsi que leurs propres\r\n\r\ncompositions. Elle continue de s’entrainer avec les musiciens chaque vendredi en\r\n\r\nstudio.\r\n\r\nCependant, ne souhaitant pas renoncer à ses études, elle décide de minimiser le\r\n\r\nnombre de ses représentations publiques.\r\n\r\nC’est grâce à internet qu’elle se fait repérer et crée très vite le buzz, sur youtube\r\n\r\net les réseaux sociaux, grâce à des vidéos et enregistrements amateurs où elle\r\n\r\nréinvente des standards des artistes qui la touchent...\r\n\r\nNe pouvant renoncer à sa passion, elle profite des vacances scolaires pour\r\n\r\naccompagner le Groupe Soft lors de quelques représentations à Paris, et se\r\n\r\nproduire sur des podiums en Guadeloupe lors de fêtes de communes. Elle a\r\n\r\naussi eu l’occasion d’assurer les premières partie de Fuckly et Riddla en 2013,\r\n\r\nPuis Misyé Sadik et Esy Kennenga en 2014. Les échanges avec le public la\r\n\r\nconvainquent de l’intérêt de son univers musical qu’elle ne cesse d’affiner.\r\n\r\nEn 2014 Lycinaïs Jean sort donc son premier single intitulé « Aimer », qui connaît\r\n\r\nun grand succès aux Antilles et en France. Il reste longtemps numéro un sur les\r\n\r\nondes et télés locales puis devient un tube. Suite à ça l’artiste a l’occasion d’être\r\n\r\nen première partie aux concerts d’Admiral T (sur deux dates) et black M en 2015.\r\n\r\nInfluencée par les sonorités qui ont bercé son enfance: Zouk, musique\r\n\r\ntraditionnelle, kompa, R''N''B, hip-hop, reggae-dancehall, soul, Pop, variété\r\n\r\nfrançaise... Lycinaïs Jean exprime avec délicatesse, mais également avec force et\r\n\r\npassion, les émotions qu’elle ressent.\r\n\r\nL’artiste souhaite partager avec le public l’étendue et la richesse de son univers\r\n\r\nmusical. Pour se faire, un premier album est à venir mais en attendant ce dernier,\r\n\r\ndécouvrez ou redécouvrez ses derniers titres Mwen enmé-w, un titre qui tourne\r\n\r\nen boucle en radio et Sex Therapy , une nouveauté composée sur un rythme\r\n\r\n« dance hall sweet » à la limite du zouk', '2014-05-22 14:32:00', 'lycinais-jean', '257139737665098', 'LycinaisJean', ''),
