(627, 'Tronixx', 'Yann HUC alias TRONIXX est un jeune artiste urbano-caribéen d''origine guadeloupéenne.\r\n\r\nC''est à l''âge de 14 ans qu''il décide de se consacrer à la musique.\r\n\r\nSubjugué par des artistes tels que Sizzla et Cappleton,TRONIXX décide de collaborer avec le collectif "Wutang PARK" et caresse l''espoir d''embrasser une carrière aussi impressionnante que l''interprète de "Take Myself Away".\r\n\r\nAvec le temps et après de nombreuses années de travail, il s''affirme et pose sur des mixtapes telles que «konèt lari 3» et «GI Riddim» qui rencontrent un succès d''estime sur les réseaux sociaux.\r\n\r\nDéterminé à apporter sa touche " perso" à la scène musicale antillaise, TRONIXX collabore avec la talentueuse DAÏNIA et nous livre en mars 2016 son nouveau titre " PIMAN".\r\n\r\nRestez connectés, TRONIXX n''a pas fini de nous surprendre.', '2014-08-25 15:45:00', 'tronixx', 'Tronixx.Officiel', 'tronixx01', ''),
