(665, 'Lindsey lin''s', 'Née le 26/02/1984 à la Garenne-Colombes (92), Lindsey est l''alliance de deux parents d''origine des Dom, sa mère étant guadeloupéenne et son père martiniquais. De cette union est née une belle jeune femme qui croit en l''avenir de sa génération. Elle a vécu les six premières années de sa vie à Bois-colombes et déjà les douces notes de musique réveillaient en elle un sentiment unique. Dès son plus jeune âge la musique a bercé tous ses sens à travers différents artistes de renoms tel que Whitney Houston ou encore Mariah Carrey. A six ans, elle déménage et grandit à Villeneuve-la-Garenne ou elle y passe toute sa scolarité.\r\n\r\nAu collège, une professeur remarque sa voix exceptionnelle et décide de lui donner quelques cours de chant durant l''heure du déjeuner, elle croit en son talant mais arrivée au lycée, Lindsey la perd de vue. Très vite, le relais est pris par une éducatrice de l''école, chanteuse, elle-même, qui la pousse et l''encourage à continuer dans cette voix là. De ce point commun, s''est succédé la participation à divers projets musicaux, de la scène et de la danse. Encouragée de toute part par ses professeurs du collège, du lycée, de sa famille, de ses amis, elle se crée un petit public toujours fidèle à son talent.\r\nSa passion pour la chanson est devenue sa façon d''exister, d''exprimer ses sentiments. Les années passent et Lindsey continue à s''accrocher à son rêve. L''amour pour la musique n''a cessé de l''envahir et faire naître une envie de plus en plus forte : devenir chanteuse .\r\n\r\nSa voix suave et unique ont séduit bien plus d''un, elle était aux yeux de tous une voix d''exception. Alors, elle chante et chante encore, tous les jours. Une rencontre particulière change sa vie et son rêve prend forme grâce à STEEVE PIERRE LOUIS, compositeur de renommé et producteur averti qui lui donne sa chance. Il croit en elle profondément, elle le respecte artistiquement. De cette alchimie est née ce premier album « la tête dans les étoiles ».Peggy Bajal, Samuel Placide, David Pierre Louis et bien d''autres artistes talentueux ont également contribué à la réussite de ce projet. Lindsey Lin''s nous arrive pour partager ses émotions les plus profondes. Une nouvelle étoile est née, regardez dans le ciel vous la verrez sûrement.', '2014-09-30 23:49:00', 'lindsey-lin-s', 'Lindsey.LINS.Page.Fan.Officiel', NULL, NULL),
