(771, 'Missié kako', 'La scène dancehall martiniquaise propulse régulièrement des talents avec lesquels il faut compter : Missié Kako est de ceux-là.\r\n\r\nOriginaire de la ville du Marigot en Martinique, Missié Kako rencontre son 1er gros succès\r\nen 2011 avec “Sur la Table” sur le Champomy Riddim de Mafio House, fer de lance des producteurs\r\nmartiniquais actuels. Le titre est très diffusé dans les soirées et fait découvrir Missié\r\nKako à un publique plus large.\r\n\r\nSimple et honnête, l’artiste met un point d’honneur à l’écriture de textes qui lui ressemblent\r\net ne cherche pas à plaire à tout prix. Missié Kako partage naturellement son quotidien et ses\r\nanecdotes, tantôt de manière décalée et avec beaucoup d’humour, tantôt plein de sérieux et de\r\nréalisme. S’il se concentre sur le dancehall et le reggae, il reste ouvert à d’autres styles musicaux\r\net défend une identité créole forte, notamment avec du kompa. Artiste déterminé, il faut également\r\nlui reconnaître le mérite d’avoir tourné et monté une bonne partie de ses clips lui-même !\r\n\r\nArrivé en métropole en 2005, il se fait progressivement un nom en sortant régulièrement des\r\nsons, regroupés dans deux mixtapes : “Gangsta Lovin” (2008) et “Alerte Rouge” (2009).\r\nA l’époque, il assure des premières parties de concerts à Lyon pour des artistes tels que Tiwony,\r\nBig Jay, Byronn…\r\n\r\nEn 2010, il s’installe à Paris et monte son home-studio : Marikultcha Recordz.\r\n“RéKpitulatif Mixtape” sort en 2012 et on y retrouve “Sur la Table”, “Jété Fizi A”, “Sé Sa Man\r\nChwazi”, ainsi que ses interventions sur les riddims Walpixx 1 et 2 ou encore sur le EDF.\r\nAprès le succès de “Sur La Table”, Missié KAKO est très demandé et se produit partout\r\nen France accompagné de Dj Jizzy (Mada Voice) et Dj Koncret D, montrant une importante\r\nmaturité scénique et une excellente capacité à communiquer avec le public.\r\n\r\nEn 2013, on le retrouvait sur “Holidays Dance 3” de Dj Ken, ainsi que sur le titre produit\r\npar Scorblaz “An Kay La” featuring Kalash, Mighty Ki La, Politik Nai, T-Jy et Davee G.\r\nEt en 2014 … il est grand temps de passer à l’album. Sortie de “I Ja Tan” le 05 mai.', '2015-03-08 12:30:00', 'missie-kako', 'MissieKako', 'MissieKako', ''),
