(832, 'Blunt', 'De son vrai nom Jimmy Lobeau , c''est un talentueux lyriciste, il sera remarqué par l''un des piliers du\r\n\r\nmouvement Hip Hop français, O-Ger membre des NEW \r\n\r\nGénération Mc, qui lança le non moins célèbre Tonton David.\r\n\r\nArtiste jusqu''au bout des dents comme il aime si bien le dire, il \r\n\r\nparticipe à de nombreuses compilations, et se fait remarquer à \r\n\r\nnouveau par le biais de "Classico Blunt" un titre orchestré par le \r\n\r\nChef d''orchestre et contrebassiste de renom Stanislas\r\n\r\nKUSHINSKI de l''Opéra symphonique de Paris 2011.', '2015-07-14 23:10:00', 'blunt', '3Elemante', NULL, ''),
