(969, 'Lale', 'Jeune artiste franco-antillais ,né le 31 Octobre 1989 en France puis grandit au Moule en Guadeloupe, il débute la musique vers les années 2007.Naturellement attiré par la Dance hall ,qui l''a nourri, il a débuté à l''age de 16 ans et commence à enregistrer dans des studios tels que Secteur D. A 18 ans il ouvre son propre studio d''enregistrement qui lui a permis une plus grande autonomie et d''auto perfectionner son style.Lale est est un artiste prometteur toujours en quête de nouvelles vybz et qui réserve beaucoup de surprises pour les années à venir...', '2015-10-28 07:43:00', 'lale', 'lalelilolukimounekila', NULL, ''),
