(1079, 'Michael', 'A l''âge de 15 ans il se passionne pour le rap et devient une des recrues de la Mafia K''1 Fry dès lors le chant et la composition deviennent ses seules passions. Il enchaîne passages radios, scènes et participe même à une édition des "Tremplins MCM" avec l''artiste Elisio.\r\n\r\nCe n''est que quelques années plus tard qu''il se dirige vers le Zouk car cette musique le correspond bien plus.\r\n\r\nL''année 2005 fut marquée par la sortie de son 1er album "MICHAEL" sur lequel il collabore avec des artistes tel que Nichols, Elizio, M''Rick et Mastercwill. Carton plein pour ce 1er opus qui nous fera surtout danser sur le légendaire titre "Se Chalew" qui restera dans les TOP10 de certaines radios durant des semaines.\r\n\r\nC''est aussi grâce à ce titre que Michaël est nominé en tant qu''Espoir Masculin au "Carribean Music Awards 2006" où il remporte un trophée le "DynaMitch d''Or".\r\n\r\nEn 2007, ce boulimique de musique est déjà de retour en studio afin de préparer son 2ème album "MES PENSEES" qu''il concrétisera avec le label Section Zouk. Les titres "Seul" et "Mes Pensées" prouveront que Michaël a toujours un public.\r\n\r\nEn 2010, son 3ème album voit le jour sous le nom de "LIFE". Rickwel, artiste de la scène R''n''B'' Zouk, l''accompagnera sur plusieurs titres comme "Tu es en moi" et "Go Lady".\r\n\r\nOn retrouve certains de ses titres sur des compiles comme "Africa Zouk All Stars", "La Jet Set du Zouk", "Section Zouk All Stars 4,5 & 6", "Zouk Kompa" et bien d''autres encore.\r\n\r\nDeux ans après, il revient avec son 4ème album "FRUIT DEFENDU" regroupant plusieurs styles musicaux dont un morceau de Kizomba qui est très apprécié de la communauté cap-verdienne et portugaise.\r\n\r\nFin 2012, il décide de changer de direction musicale et tente un genre totalement différent !\r\n\r\nC''est ainsi que l''artiste M.I. voit le jour avec le titre "Moving On" très vite diffusé sur différentes télés, comme M6 Music et MCM Top, mais aussi sur certaines radio-web.\r\n\r\nEn 2016, MICHAEL revient sur la scène musicale avec son nouveau titre " Tous les mêmes".', '2016-02-10 07:44:00', 'michael', 'ZOUKMICHAEL', 'MIKESUNS', 'michael.officiel97'),
