(1082, 'Mathieu ruben', 'Né en 1986, c’est dans ces banlieues sud de Paris que Mathieu Ruben a grandi avec ses parents et a très vite été sensibilisé par la musique: dès son jeune âge, il participe au groupe du paternel en tant que batteur.\r\nJeune artiste de la scène Reggae Dancehall française, Mathieu Ruben a été bercé dès sa plus tendre enfance aux rythmes du Reggae, de la Soul, du Jazz et du Hip Hop... Mathieu Ruben, artiste de musiques urbaines à été attiré surtout par le Reggae et notament une de ses disciplines le Ragga. Influencé musicalement par des artistes comme Bob Marley, Shabba Ranks, Buju Banton et Garnet Silk...\r\nLe combat pour la paix, la positivité et la quête de fraternité sont les principaux messages qui reflètent le quotidien et la musique de Mathieu Ruben, elle s’adresse à un public international de toutes générations confondues.\r\nAprès plusieurs enregistrements, apparitions sur des compilations et albums d’artistes confirmés, il multiplie les scènes, les interviews presses, TV, radios et crée rapidement le buzz un peu partout en France et aux Antilles.\r\nFort d’une longue expérience artistique et scénique, Mathieu Ruben nous délivre son troisième opus, album qui marque la suite logique d’une carrière professionnelle déjà riche, pour un artiste mûr, sincère et authentique.\r\nSon principal souci est de faire découvrir les vraies facettes du Reggae à un public qui n’est pas toujours informé sur les valeurs d’une musique riche en histoire et en diversité.', '2016-02-11 07:58:00', 'mathieu-ruben', 'mathieu.ruben', 'mathieuruben', ''),
