(1129, 'GNB crew', 'GNB CREW est un groupe de RAP Créole (Haïtien) \r\nFondé en 2008 par ROOZY, leader du groupe, GNB CREW était composé de 2 autres membres qui sont KASH P et DANDY.\r\nGNB CREW s''est inspiré de plusieurs modèles venus de son pays natal Haïti (Barikad crew, Rockfanm et d''autres), et, qui dans leur chansons, expriment leur pensées, leur espoirs et leur rêves de changement pour Haiti . Ils partent aussi sur le principe de vouloir faire reconnaître le Hip Hop Haïtien.ROOZY a commencé par de la musique Dancehall pendant plus de 5 ans, en écoutant les groupes de rap originaire d''Haïti comme Barikad crew, Rockfanm etc .. C''est en voulant entrer dans le milieu du Hip Hop créole, que se fait sa première rencontre avec DANDY, dans un lieu où tous les haïtiens se rejoignent sur la commune d''Aubervilliers, là où tous les membres du groupe résident.\r\nIls ont alors composés leur premier titre "sou pa renmin peye''m « (si tu n''aime pas mon pays).\r\nQuelques mois après, KASH-P a souhaité intégrer le groupe.\r\n\r\nA partir de là, une multitude de chansons exprimant leurs sentiments (joie, peine,...) ont été enregistrées en studio. Pour se faire connaître ils ont déposé leurs morceaux sur des sites spécialisés en diffusion de musique, ce qui a entraîné quelques demandes d''associations haïtiennes pour que le groupe puisse faire des représentations sur scène.\r\n\r\nEn 2009 ils font la rencontre de DICOZ de la Marque "Haitian Power" et producteur, promoteur de Rap Kreyol en France, qui a tout de suite accroché par le style redoutable de leur musique et, les invite a faire des scènes dans des Pubs comme "Le Bureau".\r\n\r\nLeur toute première scène a lieu à Porte de Montreuil, puis, pour la première fois en radio sur fréquence --paris- pluriel (106.3 FM) dans l émission ''cultures africaines '' qui a diffusé le titre ou fout fou a la suite d''une interview donnée par DICOZ, pour la promotion du Haitian Power .Suite à ça, le groupe fait plus d''une vingtaine de scènes pour différentes causes.\r\nPuis, en 2010, ils sont invités sur Espace FM et Radio Caraïbe, ainsi que sur d''autres radios qui sont retransmises sur Internet comme Radio FM Mizik dans l émission Rap Kreyol vibration.\r\nEn 2011, ils sortent leurs première MixTape qui regroupe l''ensemble de tous leur titres depuis 2010, réalisée par DJ Shalalouze .\r\n\r\nLES MEMBRES DU GROUPE GNB CREW\r\nKASH -- P, à Fort national (Haïti) - chanteur\r\nDANDY, à Saint Martin (Guadeloupe) - Chanteur et compositeur\r\nROOZY, à Carrefour (Haïti) – Chanteur', '2016-03-14 23:30:00', 'gnb-crew', '427227494073782', NULL, ''),
