(1137, 'Jvgg Spvrrow', 'Jaio Mechentel aka JVGG SPVRROW voit le jour le 4 janvier 1992 à Rio de Janeiro (Brésil). Il grandit avec ses frères en République Dominicaine puis à St Maarten dans les Caraïbes.\r\n\r\nJVGG vit une enfance heureuse mais très mouvementée, comme beaucoup de ses amis…\r\n\r\nIl développe très tôt un intérêt pour la musique et c’est lorsqu’il quitte l’école à 16 ans qu’il s’oriente naturellement vers elle. Accompagné de deux autres artistes Saint Martinois, T.O et FATTA, il fonde le groupe  » West Indian Devilz  » en 2011. C’est l’occasion de passer les premières nuits blanches en studio pour donner naissance au premiers titres du groupe :  » Get Your Face Stich Up  » et  » 1,2,3  » dont les clips sont disponibles sur le web.\r\n\r\nUne première opportunité s’offre à lui en 2012 avec Dj the Nycer (France) et l’enregistrement du titre  » Where You Wanna Go  » en featuring avec Iron Snap et Taleen au studio CV Recordz. C’est une première expérience en France pour JVGG et l’occasion d’être diffusé sur les ondes françaises et européennes avec Fun Radio, Vitamine, entre autre, et l’emmènera jusqu’en Pologne pour un live en 2013 (Chmilniki Beach et Ex Club).\r\n\r\nEn 2014 et 2015, c’est la sortie des mixtapes  » Golden Grams vol.1  » et  » Golden Grams vol.2  » abouties grâce à la rencontre de Deef.F Beats, compositeur/beatmaker et Beecy (abc.Lab), directeur artistique. Plus qu’une simple collaboration, JVGG, DEE.F et BEECY forment désormais une véritable équipe. C’est grâce à la fusion artistique de ces trois personnalités que JVGG devient JVGG SPVRROW.\r\n\r\nFin 2015 et début 2016, le côté charismatique de JVGG SPVRROW est révélé à travers une série de clips réalisés par WellDone pour la sortie de sa mixtape  » Jvgg Spvrrow « .\r\n\r\nIl signe alors avec le label ONE TIME REC-ODDS et enregistrent ensemble son premier album  » Outta Space «  dont la sortie est prévue en juin 2016.\r\n\r\nCe pirate du rap n’a pas fini de vous faire voguer sur les flows tumultueux de sa musique…', '2016-03-22 22:51:00', 'jvgg-spvrrow', 'JVGGSPVRROW', NULL, ''),
