(1192, 'Two ways', 'Groupe de zouk en duo. Neeko est originaire de Madagascar et Aycee de Guadeloupe.\r\n\r\nIls ont fait partie pendant quatre ans du groupe de R’n’B Initial2 avant de fondé le duo Two Wayz en 2004. Ils sortent leur premier album II Wayz en 2006 sous le label Erogen music3 avec Nichols à la production. Le premier single Ferme tes yeux leur permettra de décrocher un Carribean music award 2006 comme meilleur duo de l’année. Le clip sera réalisé par Chris Macari.\r\n\r\nLeur deuxième album Never Die4 sort en 2009 sur le label WUM Productions. Il comporte des duos avec LS, Saik, Marcia (Cap vert), M’Rick et Priscillia. Ils s’entourent pour cet album des compositeurs phare de leur univers musical avec notamment Thierry Doumergue, Frédéric Wurtz et Kaysha. Le premier single qui sort est le titre Réalise mon rêve suivi du single en duo avec l’artiste capverdienne Marcia, The Heat.\r\n\r\nDans la foulée de cet album, ils entament une tournée internationale entre l’Europe, les Caraïbes, le Canada et l’Afrique.', '2016-04-28 21:03:00', 'two-ways', 'two.wayz.zouk', NULL, ''),
