(1200, 'Tipi', 'Tipi l’Original est né à Choisy le Roi dans le Val de Marne en 1985. De part ses origines martiniquaises, il prit vite gout à la musique et plus particulièrement à chanter. Influencé par NTM, I AM, Passi, Kassav, Raggasoncic, Sizzla, Capelton, Turbulence sans oublier Bob Marley et bien d’autres encore, Tipi met son pied à l’étrier en commençant par créer son 1er groupe de rap «Double Entente» en 1999. C’est tout naturellement qu’il s’est dirigé progressivement dans le reggae dancehall. Les expériences vont ensuite se multiplier, comme des passages dans des radios locales, divers concerts (notamment au Club Dunois, le Divan du Monde ou encore le Trianon) , ainsi que plusieurs participations pour des évènements tel que «La Marche Mondiale Contre La Non Violence». En 2008, Tipi participe au concours Afrodisiac Production dans la catégorie reggae dancehall. Le jury composé entre autre de Féfé Typical, les 2 Bal, , Julia Channel, décide alors d’élire Tipi comme étant la nouvelle révélation reggae dancehall 2008. En 2009, il collabore avec les rappeurs Salif et Runaway sous la forme d’un featuring qui donnera naissance au titre «Nouvelle ère». Tipi toujours avide de nouveautés, prépare son maxi pour 2014, autant vous dire que Tipi l’Original arrive avec de belles surprises.', '2016-05-04 07:08:00', 'tipi', 'tipiofficiel77', 'TIPIOFFICIEL', ''),
