(1225, 'Erka marshall', 'Artiste et Beatmaker!\r\n\r\nFils de musicien Erka baigne dans la musique depuis tout petit , auteur ,compositeur et interprète il fait ses armes tout d’abord dans le hip hop avec son crew de l’époque le « N.A.T » au sein d’une radio locale ou il animait un émission qui deviendra par la suite culte pour beaucoup !\r\nErka se détache du lot avec un style inimitable pour l’époque et est déjà attiré par les influences caribéenne et locale ! Désirant apporter quelque chose de nouveau et de rafraichissant dans la musique urbaine il-Co fonde le groupe GWADA NOSTRA qui mélange à l’époque les sonorités traditionnelles aux sonorités urbaines c’est le jackpot le groupe est récompensé pour son travail par de multiples prix dont un prix SACEM !\r\nApres la séparation du groupe , désireux de continuer et d’approfondir ses connaissances il monte un collectif d’artistes indépendants « DOMTOMATIK ». De cette collaboration résultera un duo avec Oncle j , ou ensemble ils sortiront un maxi sur lequel on retrouvera le titre « Accéléré » qui leur permettra d’être jouer sur les ondes et d’obtenir des rotations sur les chaines télévisées locales set nationales dont TRACE TV ,TELE SUD etc .Ils seront aussi nominés en Afrique pour un prix.\r\nN’ayons pas la langue de bois Erka est un artiste précurseur dans sa catégorie ! véritable créatif au lourd cv il expérimente tous les jours, polyvalent il laisse cour a ses inspirations ! Il est clair que cet artiste n’a pas finis d’en étonner plus d’un !', '2016-05-17 07:40:00', 'erka-marshall', 'ErkaMarshallOfficiel', 'erkamarshall', ''),
(1226, 'Med', 'Chanteur', '2016-05-17 07:43:00', 'med', NULL, NULL, ''),
(1227, 'Pascal kondo', 'Auteur-Compositeur-Interprète, Pascal Kondo est « la voix du crooner Antillo-Americain », un Nougaro antillais à qui le créole serait la voie de la ballade.\r\nIl puise son inspiration musicale dans la Chanson française, surfant de Bécaud à Lavilliers, sur les vagues de ses racines antillaises, d’Expérience 7 à Kassav.\r\nNé un 26 Mai dans le dixième arrondissement de Paris, Pascal vit ses premières années, entre la banlieue parisienne et la section des Mangles de Petit-Canal en Guadeloupe, le cœur entre deux cultures ascendantes.\r\nSon premier succès, il le remporte à l’âge de 11 ans sur le paquebot « De grâce », en subjuguant le jury du concours de chant organisé pendant la traversée; en interprétant la chanson « Quand il est mort le poète », de Gilbert Bécaud. Depuis, la musique devint l’essence de sa vie.\r\nSa voixet son talent vont ainsi le mener des podiums de fêtes communales, en salles de concert .\r\nEn 1985, il fonde le groupe de gospel caraïbéen « Makkeda », leurs mélodies antillaises irrésistibles et leurs arrangements prenent toute liberté avec la musique. Il sortira avec le groupe, deux albums intitulés « Un pays merveilleux » et « Kré@syon ».\r\nUn saut en Martinique en 1986, pour ses études universitaires, Pascal en profite pour suivre les cours de chant de Willy Jones, dans la pépinière d’artistes du SERMAC de Fort de France.\r\nDe retour en France en 1993, Pascal se fait remarquer au 10ème festival Séphora à Valence, en avant-première du groupe américain « Acappela ». Cette même année, Pascal partira suivre les cours du « Studio des Variétés »», l’un des plus célèbre Centre de formation artistique de Paris. Par lequel sont passés entre autre, Faudel, Etienne Daho et Ophélie Winter. Il y étudiera le chant et la scène mais se passionnera surtout pour le texte, sous la direction du parolier Brice Homs.\r\nEn 1995, à la demande de Brice homs, Pascal compose et propose deux chansons pour Henri Salvador.\r\nPar la suite, Pascal se concentrera à l’écriture et à la composition, notamment pour le groupe de gospel guadeloupéen « Dyapason Quartet », ainsi que pour le groupe « Fretlessé.\r\n\r\nLe 15 Juin 2009, Pascal Kondo nous livre un premier opus « Sa ki taw ». Un album qui reflète une profonde alchimie entre diversité et amour des mots, relevés de rythmes traditionnels.', '2016-05-19 07:47:00', 'pascal-kondo', NULL, NULL, ''),
(1228, 'Doré', 'Chanteur', '2016-05-19 07:51:00', 'dore', NULL, NULL, ''),
(1229, 'Dinh VZ', 'Plus connu sous le nom " Vietzoukeur", Dinh VZ est né au Vietnam, a grandit en Haute-Savoie et a vécu 9 ans aux Antilles.\r\n\r\nC''est en 2013 qu''il crée le buzz avec son titre " Twa Kilti "  qui à ce jour a été vu plus de 390 000 fois sur Youtube. Il sort ensuite deux autres titres " Mèsi " et " Eu Te Encontrei ". En 2015, il interprète " 1,2,3,4, bougé " une musique d''ambiance en collaboration avec Christian Yéyé.\r\n\r\nAujourdhui, il nous présente son nouveau titre " Ola ou yé ", un zouk (créole-vietnamien) qui parle d''amour et de positivité. Il prépare également son premier album prévu pour la fin de l''année 2016.', '2016-05-23 00:12:00', 'dinh-vz', 'vietzoukeur', 'vietzoukeur', ''),
