(1262, 'Karl-j', 'KARL-J, de son vrai nom Johan Karl Jomie, est un artiste de reggae-dancehall français. Inspiré par Admiral T, Buju Banton , Shabba Ranks ou encore Vybz Kartel.\r\nOriginaire du Gosier en Guadeloupe, il fait tout d''abord ses premières armes dans le rap mais se tournera très vite vers le ragga. Il débute à 16 ans dans les petits sounds systems de lycées et de quartiers avant de faire la rencontre d’IMANI qui lui permettra d''exploiter toutes les facettes de son talent.\r\nil signe chez Enterpies Music et sort le 02 mai 2016 sa première Mixtape, Composer de 11 titres Explosifs. Entre dance hall, trap, zouk et RnB,son style donne envie de danser avec des morceaux dynamiques.\r\nKarl J c''est le phénomène antillais a venir. Une voix grave, un flow rapide et des refrains mélodieux. Le chanteur fait un carton avec son titre « Banton» .', '2016-06-05 17:01:00', 'karl-j', NULL, NULL, ''),
