(1277, 'LJ', 'Après s’être fait connaître via internet et de nombreux concerts et premières parties ( Melissa M,El Matador,Mokobe,Jessy Matador) à travers la France LJ sort en 2008 son premier single et clip * REVIENS MOI * .\r\nIl continue sur sa lancée en 2009 avec son Street album * MON STYLE * .\r\nC’est fort de se jeune succès qu’il commence à travailler sur les maquettes de son futur projet .\r\nEn 2010 LJ signe son nouveau titre * DANS MA PARTY * feat Willy William (Collectif Métissé)\r\nChez HAPPY MUSIC .\r\nPlaylisté sur FUN RADIO et NRJ , le clip se voit programmé sur M6 , MTV , MCM et trust les premières places des classements clubs .\r\nLJ c’est aujourd’hui 12 000 fans réunis sur les réseaux sociaux et plus de 2 000 000 de vues sur YOUTUBE .\r\nEn 2012 parallèlement à son rôle d’auteur chanteur et producteur de son premier album *BORN TO SHINE * \r\nLJ compose et écrit les titres * Kan je l’ai vue * et * Pour elle * de l’artiste DOUTSON programmé lui aussi succesivement sur FUN RADIO avec ses deux singles .\r\nL’aventure continue donc pour ce jeune artiste qui n’a pas fini de nous surprendre son énergie positive est un vrai vent de fraicheur !!!\r\n\r\nAlbum dispo ici ---> Premier Album " BORN TO SHINE " disponible ici --> https://itunes.apple.com/fr/album/born-to-shine/id607386591?l=fr&ls=1', '2016-06-14 22:28:00', 'lj', 'LJOFFICIAL', NULL, ''),
