(1303, 'Layssia', 'Layssia est une artiste originaire de la guadeloupe qui a tjrs été bercée par la musique et la danse.\r\nBien qu''elle soit plus connue en tant que danseuse pour avoir fait partie de plusieurs groupes à succès dont les shelka wine elle n''a jamais arrêté de se livrer à sa passion: la chanson\r\nSes goûts hétéroclites lui ont permis de poser sa voix aussi bien sur du rap, du r&b, que sur du zouk.\r\nAujourd''hui bien entourée par ses labels diamond music et Activist Music elle compte vous faire découvrir son univers rempli de surprises.', '2016-07-13 07:48:00', 'layssia', 'layssiaofficiel', 'LayssiaOfficiel', ''),
