(1309, 'Niffay', 'D''origine comorienne, pour Niffay la musique est une affaire de famille. Entourée de chanteurs et musicien au sein de sa famille c''est tout naturellement qu''elle a baigné dans un environnement rythmé par des mélodies tant occidentales que traditionnelles\r\nElle participe il y a quelques année à un concours qui lui permis de redécouvrir sa voix et sa tessiture vocale qui la rende exceptionnelle. Embrassant la musique R''n B, Cette jeune artiste éclectique aime allier différentes couleurs musicales sans oublier ses origines.', '2016-07-15 23:52:00', 'niffay', '873399512739552', NULL, ''),
