(1314, 'Skydone', 'Au début de son adolescence au milieu des 90’s en Picardie, Skydone découvre les fondations de la musique jamaicaine et du reggae francophone à travers son frère Zaijohn livity, lui-même raggamufin par passion.\r\nSous l’épaule de Zaijohn livity, SKYDONE commence à freestyler dès que le micro est ouvert et à écrire ses premiers textes. A cette époque, il écoute en boucle Black Uhuru, et admire la verve de Mickael Rose…Sans manquer le dancehall francophone du moment : Lord Kossity, Nuttea, et tant d’autres…\r\nDès 16 ans, il simisse dans les soirées du 102 attack massive, et exerce ses premières gammes lyricales avec la vieille école…\r\nL’année 2007 marquera un tournant artistique dans sa vie musicale : arrivé à Paris pour des raisons professionnelles, il entame des rencontres qui se réveleront décisives par la suite. En effet, le compositeur-chanteur ARTIKAL JOLLY du West indies Tribu l’encourage à structurer son travail en studio, à construire son parcours sur scène, et à travailler son chant !!\r\nAinsi, son style singjay (chant marié au toast) commence à se façonner sur les faces B jamaicaines à chaque session. Durant cette même année, il pose le titre « Pull up le Riddim » sur la compilation Ragga Hip-Hop INSERTION de KARTEL du 102 Attack Massive.\r\nEn 2008,  Blacko l’accompagne et le conseille afin que SKYDONE étoffe son chant sur les riddims new roots.\r\nIl s’en suit une multitude de rencontres musicales avec SISTA JAHAN, NAZAREKEN…qui contribueront à finaliser son premier Street CD : Skydone and Friends vol 1.Ce premier opus est un simple remerciement à celles, et ceux qui partagent au feeling une vibe, une session pour des morceaux reggaehumaniste !!!\r\nPendant quelque temps Skydone se retire pour écrire, et revenir avec des textes toujours plus engager, et toujours plus conscient. \r\nEn 2015 Skydone revient sur le devant de la scène, inviter à partager un morceau sur scène avec Yaniss Odua & Jamadom.\r\nSon expression musicale le conduit à faire la première partie d''Admiral T à Lille en mai 2015 et de Tiwony en juin 2015. \r\nSkydone sortira un nouveau projet fin 2015 , intitulé "MUSIQUALITE"\r\nSKYDONE revendique son humanisme avec des textes chargés de positivité, d’espoir, et d’un message fort pour la jeunesse.', '2016-07-18 07:42:00', 'skydone', 'skydone.indiafrica', NULL, ''),
