(1329, 'Mike overlord', 'Pour certains, la musique n''est pas qu''une passion, c''est une révélation. Mike Overlord en est sur. D''ancien dj à compositeur/interprète, c''est sa musique qui a pu le révélé auprès de son public. Il a commencé son petit bonhomme de chemin à l''âge de 14 ans, et depuis le chant est une grande histoire d''amour. La musique lui ouvre les bras, et depuis ils ne se sont jamais quittés. Du Gospel au rap, a l''afrobeat (coupé décalé, azonto, Naija) en passant par le zouk/kompa et rnb…Mike est un de ces artistes aux multiples talents prometteurs, et aux gouts musicaux éclectiques. Aujourd’hui son public est envouté, par le travail, le talent et la dextérité de ce trentenaire. Ses nombreuses collaborations font de lui le professionnel artistique aux valeurs sur et authentiques, mais en attendant découvrez le clip de Mike Overlord « Party up », qui sera surement l’un des clips les plus reconnus.\r\n\r\nDécouvrez dors et déjà quelques uns de ses titres sur toutes les plateformes de téléchargement légal: "Do it" (dancehall)/ "Envouté" (Zouk/kompa)/ "So lonely" ( R&B)/ "Boumba Faya" (Zouk/kompa)/ "Party up" (Azonto/Naija).', '2016-07-27 07:28:00', 'mike-overlord', '342457175814337', NULL, NULL),
