(1339, 'Wakanza', 'Les trois membres de WAKANZA, ont longtemps interprétés pour les autres.\r\nIls marquent alors les esprits de nombreux artistes de la scène antillaise, afro-lusophone et même internationale à l’occasion de collaborations scéniques et studio.\r\nLeur musique est éclectique...\r\n\r\nQUE SIGNIFIE "WAKANZA"?\r\nWAKANZA est un savant mélange de trois mots pleins de sens pour ce groupe aux origines diverses:\r\nKAWAN signifiant ‘‘Amitié’’ en malais, WAKAN ‘‘sacré et puissant’’ en sioux, et le KWANZAA, célébration afro-américaine visant à honorer les origines africaines et ayant pour fondements principaux l’unité, l’auto-détermination, la coopération, la créativité et la foi.\r\nAprès cinq ans de projection, Kailyn Ryse, Mykïtone et Sir G, le trio WAKANZA voit le jour...', '2016-08-03 07:51:00', 'wakanza', NULL, NULL, NULL),
