(1345, 'Anthony Delaure', 'Né à Abidjan en Cote d’ivoire de père et mère ivoirienne, Anthony DELAURE a grandit au sein d’une grande fratrie dans un quartier populaire de la capitale.\r\nDès son jeune âge il était attiré par la musique. En 1987, l’avènement du groupe Kassav avec un nouveau genre musical : le Zouk et ses nouvelles sonorités l’orienteront dans cet univers.\r\nIl sera révélé au public ivoirien par la radiodiffusion télévision ivoirienne (RTI) à travers l''émission "Podium" à laquelle il participe avec son groupe le CEBBIC de Marcory\r\nA l''issue de cette aventure il enregistre la maquette de ses premières chansons.\r\nEn 1995 il commence à travailler avec David Tayorault avec lequel il enregistrera son 1er OPUS « An ti doucè » qui connaitra un grand succès en Côte d''Ivoire.\r\nGrâce à ce succès Anthony Delaure a fait de nombreuses scènes en Afrique et en Europe.\r\nEnsuite s’en suivra une longue collaboration avec l’arrangeur Thierry Galion sur plusieurs projets musicaux.\r\nEn 2013 il sort le single «Chérie viens ô» avec les arrangements de Thierry Galion. Une œuvre avant-gardiste rythmée de sonorités Afro, Zouk, pop, dance hall, ragamuffin.\r\n"Chérie viens O", une œuvre très rythmée qui rappelle la chaleur des tropiques, à travers le genre Afro zouk, version nouvelle génération, chantée en français et en argot Ivoirien, est un clin d´œil à toutes les femmes.\r\nEn mars 2014, Anthony Delaure revient sur scène avec "Yo mi bien", sortie chez Wagram sur la compil "Hits Africa" qui regroupe les meilleurs titres africains de l''année 2014', '2016-08-10 07:44:00', 'anthony-delaure', 'AnthonyDelaure', 'Anthonydelaure', 'anthonydelaure'),
