(1348, 'Jamice', 'D''origine latine Jamice est le fruit d’une mixité culturelle et musicale. Sa musique est un mélange de sonorités caribéennes allant du merengue au zouk mais aussi de vibrations urbaines comme le rn’b ou le reggæton..Il débute sa carrière en chantant dans diverses chorales de la capitale tout en écrivant des chansons personnelles au piano. En 2000, il rencontre Steve Pierre louis, et apparaît sur l’album de Youri « Dis-moi pourquoi ». En fin d’année, il sort son premier album Zouk Rn’B avec son acolyte Keli sous le nom de « IN’EDIT » (Pastel Prod.) En 2003, Jamice produit son 1er album solo « Quelques mots d’amour » (Jam Records/Phoenix Records), réalisé par Steeve Pierre Louis… En 2004, il interprète le titre « Amores » sur le concept « Carribean Voices » (Evans Prod) et participe à la compilation « Section tubes Vol.1 » (Section Zouk) avec le titre « Sa mwen lé » réalisé par Nichols qui marquera le début d’une longue collaboration. Mars 2005, l’artiste intègre le label Erogen Music qui sort l''album « Latin’ Lover » dont est extrait le tube international « Maravilla » et les hits : « 7ème ciel », « You » et « Fleur d''ébène » en duo avec Priscillia. Le succès de l''album et de l''artiste se traduit par une tournée internationale (différents pays d''Afrique, USA, Europe...) et une reconnaissance du talent et du style de l''artiste... N’oubliez pas ce prénom : JAMICE… Mars 2007; comme on ne change pas une équipe qui gagne, Jamice remet le couvert avec Nichols et Erogen Music. 11 titres inédits allant du zouk au compas et du Reggaeton au cabolov'', un invité de marque Mika Mendes! Et ABG pour une combinaison à faire péter les monitors! L''album « Suave » n''est pas une confirmation... Il est la suite logique d''un succès annoncé... Pendant 2 ans Jamice parcours le monde, a la rencontre de son public, jusqu’a ce qu’il se sente prêt a écrire de nouvelles chansons.. En 2010, il s’essaie a de nouvelles couleurs sur la compilation Kizomba All Stars 2 le hit « Amor » est retenu et sur Zonerogen 2 avec « Pour te séduire », « Ce soir » en featuring avec Nichols et « Kretcheu » pour tester sa nouvelle direction musicale...Durant l’été de cette meme année, Erogen Music & Cabo Style Prod s’installent au Cap Vert pour 25 shows ! Un public conquis inspire l’artiste... Janvier 2011, Jamice, Nichols et Iron’G s’enferment dans le studio de Thierry Doumergue pour donner vie a ce que le public lui a inspire dans ses voyages. Trois mois plus tard, l’album est fin prêt à sortir... On retrouve des compositions de Thierry Doumergue, Pierre « Hypnoz » Charville, Nichols, Ronald Villa et de l’artiste Jimmy. Des invites tels que Jade, Iron’G, Nina Monteiro, Nichols et Mika Mendes (on ne change pas d’amis !). « Quatro », 14 titres, 3ème album, arrange et realise par Nichols pour Erogen Music en 7 ans de collaboration. Vous ne le savez pas encore mais vous serez surpris en pressant « Play ». On dit que les voyages forment la jeunesse... C’est vrai !!... Soyez prêts the ‘Latin Lover’ is back !!', '2016-08-12 07:36:00', 'jamice', '176556362368824', 'JamiceJam', NULL),
