(1354, 'Steven morris', 'Steven Morris, de son vrai nom Steven-Morris Lagier naît en 1979.\r\nFils de l’un des musiciens fondateurs de Malavoi, le violoniste Maurice Lagier et de la chanteuse de Jazz Jacquie Defoi, il grandit en Martinique à la croisée des rythmes noirs américains et caribéens. Dès ses premiers mots, il chante et prend l’habitude de suivre ses parents en tournée.\r\nBien que chantant en chorale dès petit, il tombe amoureux du rap et du Raggamuffin en 1990 et évolue essentiellement dans les sound system jusqu''en 1994 où il monte un groupe vocal du nom de « Kontact » largement inspiré de Boys II Men et de Shai mêlant Zouk et Rn’b. Il joue sur les deux tableaux et tourne sur toutes les scènes possibles telles que celle du festival de jazz de Fort de France en 1998.\r\nEn 1999, les membres du groupe se séparent temporairement car chacun part effectuer leurs études en France. Arrivé en France, c’est dans le Rap et le Raggamuffin que notre ami fait ses gammes tout en donnant la priorité aux études.\r\nDepuis 2003 il intègre le groupe Timeless Gospel avec lequel il tourne jusqu''à présent. Cette formation l’impose de la rigueur vocale et scénique. Notre artiste décide dès lors, de donner la priorité au chant et mets les deux autres styles urbains en standby. Cependant il monte son label Family Sound à travers lequel il produit des mixtapes Reggae, Rap et Dancehall. Concerant ses choix de carrière, Steven Morris décide de se consacrer au Zouk et au Rn’b', '2016-08-17 07:48:00', 'steven-morris', 'stevenmorrisofficial', 'Stevenmorris972', 'stevenmorris972'),
