(1372, 'Remi', 'RE-MI est né à Saint Martin, une voix qui sort d’une bulle de gospel, avant de se peaufiner avec des influences du rythm and blues. Se servant de ses racines et du style de ceux qui furent pour  lui une inspiration, il s’est créé une identité. \r\nSon île natale a découvert depuis peu, une voix nouvelle, une voix fraiche et pétillante, son style est un mélange de pop, RnB et Soul, mais il sait aisément changer le rythme et la cadence, en touchant le reggae et le hip hop. RE-MI est une promesse, un artiste qui ne cesse d’évoluer et qui embarque avec la chaleur tropicale pour un voyage qui tardera à toucher à sa fin.\r\n\r\nJeune chanteur, auteur, compositeur et interprète du style gospel, Pop, Rnb, et Soul. Passionné par la musique et le chant depuis son plus jeune âge. Il a fait ses débuts, en 1998, en tant que chanteur avec le groupe gospel « Cri de Victoire ». Puis en 2009, il évoluait en tant que lead vocal au sein d’un autre groupe gospel; « Happy singers ». \r\nIl a notamment participé à plusieurs concours musicaux où il a pu faire apprécier son talent en tant qu’artiste en solo: - En 2008, la participation avec le groupe V4 au concours de Noël Haïti chérie. - En 2012, il a participé à « Star aux éclairs » (Un concours de chant à Saint Martin) où il a décroché la 2me place. Il a également participé à « la Guadeloupe à des talents ». \r\nIl s’est fait connaître (à Saint Martin) avec un premier single: Sonde-moi; une composition du style gospel. Puis, il a enchaîné avec un deuxième single intitulé La peine. En 2014, il sort le morceau « Paka Viv San Ou », un morceau dont il est le compositeur. Ce single lui donna l’opportunité de collaborer avec le talentueux réalisateur guadeloupéen CIGEY. \r\nEnfin, il a eu l’opportunité de participer en tant qu’acteur, à une série tv policière. Récemment, il a été sélectionné pour la demi-finale du concours TRACE MUSIC STAR, où il eut l’opportunité de se faire entendre par le jury de Trace et le public martiniquais.', '2016-08-27 21:12:00', 'remi', 'REMISXM', 'REMISXM', 'remi_officiel'),
