\nEt après tout j’ai des remords, JE M’EN VEUX, JE M’EN VEUX, JE T’AIME TANT\r\nEntre nous c’était merveilleux, ce sera dur d’avancer maintenant\r\nJe sais pourtant qu’on s’aime encore, JE T’EN VEUX, JE T’EN VEUX, ON S’AIME TANT\r\nJe plaisantais c’est merveilleux que je me sois réveiller à temps\r\nRefrain :\r\nAujourd’hui tu t’en vas, faut faire fissa fissa\r\nTon taxi est en bas, ne me remercie pas\r\nBON VOYAGE, Ciao Bye bye il fallait y penser\r\nTON BAGAGE  t’attends en bas, fallait pas me tromper !\r\n\r\nT’inquiètes pas pour moi je saurai te remplacer \r\nJ’avais peur avant de pouvoir te quitter \r\nMiroir ô joli miroir tu m’as réflété \r\nQue je suis belle et que je peux recommencer', NULL, 'Givmeall', 0, NULL),
