(1620, 'Warrior', 'Bz0SNvRS7d0', '2015-08-26 07:45:00', 1, 'warrior', 'Building Empire Production', '█▬█ █ ▀█▀ ██▓▒░ EZAÏL - WARRIOR\r\n\r\nContact : Ezailmanagement@yahoo.com  \r\n\r\nLogarythm'' Group / Building Empire Production\r\n\r\nFACEBOOK :  EZAIL OFFICIEL\r\n\r\nTWITTER : EZAIL OFFICIEL\r\n\r\nINSTAGRAM : EZAIL_OFFICIEL \r\n\r\n\r\nWARRIOR - EZAÏL (Paroles)\r\n\r\nUn état d’esprit,\r\nun leitmotiv,\r\nNou ka upgrade, on monte la famille\r\nUn mental d’acier pour avancer\r\n\r\nINTRO :\r\n\r\nJod la an lévé èvè souri\r\nlévé lé zyé o syèl\r\nan vwè dé zanj ka kouri\r\nAlo an voyé on priyè, voyé on priyè\r\nPou dèmen mié ki yè, dèmen mié ki yè\r\nAll mighty ban nou bon foss\r\nAll mighty ban nou bon foss\r\n \r\n\r\nREFRAIN :\r\n\r\nYo di nou la vi la rèd\r\nPou réisi fow pren''y en scred\r\nNou pani ayin a pèd\r\nEvè foss a papa la #NouKa\r\nProgrésé kon dé warrior #NouKa\r\nTravay pou viv kon dé wa #NouKa\r\nChasé tout mové lèspri\r\nKi té vlé fè nou pèd\r\nKi té vlé fè nou pèd\r\n\r\n\r\nCOUPLET 1 :\r\n\r\nAll Mighty Father ka gidé nou tout\r\nPa bizwen fè bad\r\nPou touvé la route\r\nGadé jan vi la sa kout\r\nFowmé on ékip\r\nDétermination et éthique\r\nVérité la ké toujou rèd a asimé\r\nBa yo love\r\nSé yo prèmyé ké vlé téré''w\r\nGwada nou soti\r\nPa pwan nou pou apranti\r\nBoujwazi ou lari\r\nOu ké vwè mwen ka ri\r\nAhahahaha\r\n\r\n\r\nREFRAIN :\r\n\r\nYo di nou la vi la rèd\r\nPou réisi fow pren''y en scred\r\nNou pani ayin a pèd\r\nEvè foss a papa la #NouKa\r\nProgrésé kon dé warrior #NouKa\r\nTravay pou viv kon dé wa #NouKa\r\nChasé tout mové lèspri\r\nKi té vlé fè nou pèd\r\nKi té vlé fè nou pèd\r\n\r\n\r\n\r\nCOUPLET 2 :\r\n\r\nJ''ai choisi ma voie\r\nEt je ne renoncerai pas\r\nJ''entends tous ces faux -jetons\r\nQui parlent sur moi\r\nMè an paka fréné\r\nNèg toujou ka ra''y Nèg pou dé banalité\r\nUn homme qui ne vit pas ses rêves vivra un cauchemar\r\nJ’veux atteindre le sommet\r\nJ’en perds même le sommeil\r\nTravay si travay\r\n Les chinois tu les connais\r\nUn but à atteindre ?\r\nNon faut pas déconner\r\nMoi j’en ai des milliers\r\nJ’veux garder ma fierté\r\nSi manman pa fiè timoun ay an ké échouwé\r\nGwada tèlman rèd an vlé pa finn ékroué\r\nAn pakay goumé pou on gout dlo,\r\nAn ka fè douvan an paka mélanjé èvè zannimo\r\n\r\n\r\nREFRAIN :\r\n\r\nYo di nou la vi la rèd\r\nPou réisi fow pren''y en scred\r\nNou pani ayin a pèd\r\nEvè foss a papa la #NouKa\r\nProgrésé kon dé warrior #NouKa\r\nTravay pou viv kon dé wa #NouKa\r\nChasé tout mové lèspri\r\nKi té vlé fè nou pèd\r\nKi té vlé fè nou pèd\r\n\r\n\r\n\r\nOUTRO :\r\n\r\nEvè lè kolègue é séla ka fè douvan\r\nToujou ni malpalan an paka stopé si yo\r\nNou ka désann an game la kon akiyo\r\n\r\n\r\nDISCOURS :\r\n\r\nOk, on spésial big up\r\nPour tous les jeunes entrepreneurs, travailleurs, chefs d’entreprise\r\nTou séla ka antrèprann on bitin an vi a yo\r\nPou vwè on méyè landèmin\r\nNi vyolans\r\nMè ni osi onlo jenn ka goumé pou réisi\r\nKé réisi é ka réisi\r\nE ka promosyoné péyi la ki sé an lokal ou à l''international\r\nBuilding Empire nou la #Nouka\r\nLogarythm Group nou la #Nouka\r\nGwadloup nou la #Nouka\r\nPoté ganm la\r\nOne more time\r\n\r\nREFRAIN :\r\n\r\nYo di nou la vi la rèd\r\nPou réisi fow pren''y en scred\r\nNou pani ayin a pèd\r\nEvè foss a papa la #NouKa\r\nProgrésé kon dé warrior #NouKa\r\nTravay pou viv kon dé wa #NouKa\r\nChasé tout mové lèspri\r\nKi té vlé fè nou pèd\r\nKi té vlé fè nou pèd\r\n\r\nFIN\r\n\r\n- Choeur : KARMA\r\n- Beatmaker : LILEX\r\n- Réalisation : Building Empire\r\n- Record :  Building Rekordz\r\n- Mix : Logarythm'' Group\r\n- Mastering Jamy Music', NULL, 'BuildingEmpire_', 0, NULL),
