(1778, 'Marqué A Vie', '522He4MMjIM', '2015-11-01 23:55:00', 1, 'marque-a-vie', 'Brasco Officiel', 'Nouveau titre de Brasco\r\n\r\nTélécharger "Marqué A Vie" :\r\niTunes - http://po.st/MAViTunes \r\nGoogle Play - http://po.st/MAVGooglePlay \r\n\r\nRetrouvez Brasco :\r\nFacebook - http://po.st/BrascoFB\r\nTwitter - http://po.st/BrascoTW\r\nInstagram - http://po.st/BrascoIG\r\n\r\n* Contact promo & management : ombeline@purplemusicagency.com\r\n\r\nCrédits : \r\nA/ Brasco\r\nC/ Daddy OG\r\n℗ & ©  - O-VNEE MUSIC\r\n\r\nClip réalisé par N.L.E Labo\r\n\r\nAvec 3 Styles Ink :  https://www.facebook.com/3stylesink/?pnref=story \r\n\r\nDécouvrez qui est Brasco sur Wikipédia ! http://po.st/BrascoWikipedia \r\n\r\n-------------- Marqué A Vie --------------\r\n\r\nGrand black tatoué, Ice,\r\nComme un guerrier tatoué,\r\nLes aiguilles finissent par me chatouiller \r\nMon frelo ice kaïda n''est pas  douillet\r\nJv jm''tatoué l''trône quand les mecs vont s''agnouiller   \r\nLa Guadeloupe dans ma tête quand je rentre en scène  \r\nEt l''Afrique dans le cœur respect aux ancêtres\r\nMe parle pas d''initiale de gonzesse \r\nSinon  mon corps serai rempli de prénom d''mes ex  \r\nPas de question de love la rage du punisher  \r\nAucune issue pour les putes et les pleurnicheurs  \r\nC''n''est pas pour donner un style de mauvais garçon  \r\nJss un black spartiate survivant des 300  \r\nO ns''bat plus que d''autre ouai on naît comme on naît   \r\nMon phénix te l''dira quand je tombe je renais\r\nLe dieu soleil qui m''épaule\r\nJ''vais pas m''contenté d''être le King  des halls  \r\n"SCO"\r\nRetour aux pyramides avec les pharaons \r\n "Apothéose" à l''époque on était 3 larrons  \r\nFin d'' l''aventure On reste proche \r\nDans nos cauchemars on n’oublie pas nos rêves de gosse\r\nMon micro à des gants d''boxe \r\nDéfier  tous les grands bosses \r\nStreel Live jusqu''à la mort tête d''os   \r\nSur la tête de mes dread loeks \r\n\r\n\r\nMon histoire est sur ma peau\r\nTatouée comme un guerrier maori  \r\nL''encre noire j''en suis accro \r\nMon parcours est gravé sans calomnie \r\nJss marqué à vie marqué à vie \r\nBlack Picasso quand ice a dessiné...\r\nMarqué à vie marqué à vie  \r\nJusqu’à la mort je compte bien l''assumer …\r\n \r\n\r\nInvincible incorruptible, la rue me la appris  \r\n(M’a appris) Mon corps est une toile j''illustre ma vie\r\n(ma vie)   \r\nSans regret… Je représenterai  \r\nTatoué le nom d’un être cher qui repose en paix \r\nR.I.P Ou un être cher qu''on voit grandir  \r\nMais quand ma future femme sera décidée (décidée) mes frelo me disent de ralentir\r\nJ''ai l''art dans la peau et l''œil sur ma destinée\r\n(Hé) les propos néfastes ne m''empêchent pas de sourire devant mon mirror\r\nJ''en ai trop sur la peau mais si j’efface c''est comme si ; on me retirait la mémoire\r\n"woow"\r\nChaque tatouage a son histoire pas besoin d''avoir le gabarit à fifty \r\nLaissez des empreintes sur une partie de soi.. Comme un mur de graffiti\r\nHeuuuy dans aucun gang aucune mafia de toute façon j''approuve pas \r\nHa ce sont les couilles ; et non le tatouage qui fait le yakusa \r\nHaa Regarde bien c’est ma biographie c''est ma philosophie frelo à vie j''suis marqué  \r\nÇa  t''explique d''où je viens qui je suis et ce que j''ai surmonté', NULL, NULL, 0, NULL),
