(1826, 'Our army', 'sLuTPqBLVOg', '2015-11-20 20:56:00', 1, 'our-army', 'vjlouofficial', 'VJ LOU ft. E.SY KENNENGA - OUR ARMY:\r\nItunes: https://itunes.apple.com/fr/album/our-army-feat.-e.sy-kennenga/id1058950214\r\nGoogle Play: https://play.google.com/store/music/album?id=Bk6f2b7oxjfbail3ytd2p4wt7ny&tid=song-Tuy5nxnhkhbymyxinrtb4dlz72i\r\nAmazon: http://www.amazon.fr/Our-Army-feat-E-sy-Kennenga/dp/B017Z2HPIK/ref=sr_1_12?ie=UTF8&qid=1447859318&sr=8-12&keywords=vj+lou\r\n\r\nCes images sont issues de nos voyages et nos rencontres avec les #SoldaLanmou à travers le monde. De Singapour au Ghana en passant par la Martinique "Par les good vibes on est liés"\r\n#OurArmy\r\n\r\nCredits:\r\n\r\nAuteur : E.sy Kennenga\r\nCompositeur : Cisko\r\nEnregistrement : Vj Lou\r\nMix : VJ Lou\r\nMastering : Mike pour E-Max\r\nCadrage : Ti Paul production, MK pour EK & Vj Lou\r\nRéalisation: Vj Lou\r\nProduction: Vj Lou (2015)\r\n\r\nVJ LOU :\r\nFacebook : https://facebook.com/TheVjLou\r\nTwitter : https://twitter.com/VjLou\r\nInstagram : https://instagram.com/vjlou\r\nhttps://www.VJLOU.com\r\n\r\nE.SY KENNENGA:\r\nFacebook : https://facebook.com/EKennenga\r\nTwitter : https://twitter.com/Esykennenga\r\nInstagram : https://instagram.com/Esykennenga\r\nhttps://www.ESYKENNENGA.com\r\n\r\n\r\nRemerciements: \r\nFrench Caribbean Touch\r\nAir Caraibes\r\nAF Accra\r\nAF Kumasi\r\nDAC Martinique\r\nSteevo\r\nBaba\r\nDelphy\r\nCisko\r\nShiny\r\nMike E-MAx\r\nEK Shop', NULL, 'VJLOU', 0, NULL),
(1827, 'An Bra''y', 'abHMXhWqYC0', '2015-11-22 22:01:00', 0, 'an-bra-y', 'Paille Officiel', 'Prod. by Dj Gil\r\n\r\nMorceau disponible sur la Mixtape de Dj Gil The Night Leader en téléchargement libre ici  http://www.mediafire.com/download/53aaxjn1h3hp01t/Dj+Gil+%23TheNightLeader+Mixtape+2.zip\r\n\r\n\r\nRéalisateur : Black Childish\r\nhttps://www.facebook.com/ABlackChildish/\r\n\r\n\r\n\r\nTEXTE INTÉGRAL:\r\n\r\n1ER COUPLET\r\nI ni mwa tou sa koumansé mé  « histoire » la pa klè\r\nI ni mwa nonm-lan tourmanté pas fanm-tala ka plè’y\r\nÉ pou an fwa tjè’y ka chanté sé tout kò’y ka fè’y mal \r\n\r\nI sé lé di’y ke i ka mantjé’y  mé sa ka fè’y pè\r\nPétet li osi sé sa i ka pansé mé sa pa «  certain »\r\nKoumaniè pou rann li fol sé bondié sel ki sav\r\n\r\né kon lalin an siel  pli i gadé’y pli i santi  sé tout kò’y ka mò ba’y \r\ni sé lé viv an pié’y pou pétet an jou ni lachans di lévé an bra’y\r\n\r\n\r\nREFRAIN \r\nAN BRA’Y...\r\n\r\n\r\n2EME COUPLET \r\nLavi-a ka bel mé fo pa ou mandé’y twop\r\nÉ lanmou-a ka red lè ou wè i ka mòdé’w fò\r\nI siplié bondié i pa té las mandé’y fos\r\nPou espliké fanm-lan ke tjè’y ka mandié kò’y\r\nAn jou lanvi-a pran’y i néglijé « la méthode »\r\nI tjenbé’y pa lanmen non i pa ralé’y fò\r\nI gadé’y an zié  , i pa té lé palé twop\r\nDoudou sé ou man lé non man lé ayen dot\r\nJe veux apprendre ta leçon, laisse moi venir à l’école\r\nLa vérité  , dans le fond , je ne connais pas les codes\r\nMais je veux vieillir avec toi comme ça se faisait à l’époque\r\nAnnou suiv chimen-an\r\n\r\nÉ pli i palé ba’y , pli i ouvè tjè’y pli ti fanm-lan santi  i ka mò ba’y\r\nSi c’est la destinée i pa kay atann i za paré pou vlopé an bra’y\r\n\r\n\r\n\r\nREFRAIN\r\nAn bra’y…\r\n\r\n\r\n\r\n3ÈME COUPLET\r\né dépi sa , i pa ba’y an pa \r\ni viv an siel bò an zétwal\r\n\r\nan bra’y  an bra’y  an bra’y  an bra’y\r\n\r\nil a connu la peur de l’attente  , la crainte de l’absence  l’amour qui crée le manque\r\nMais quand sa bouche l’apprend, sa peau il l’a sent il en n’oublierai le monde\r\nEt si peu de choses les  rassemblent, l’envie les rapproche comme deux imbéciles qui s’aiment\r\nLes autres parlent d’inconscience, ils répondent par la confiance en un dieu qui sait ce qu’il fait \r\n\r\nÉ si  yo tou lé dé « l’éternité » pa asé long\r\nI pa bizwen dot fanm pou i santi kò’y  asé nonm \r\nYo sé lé vwayajé mé le « monde » pòkò asé gran \r\nMenm si yo viv mil fwa yo pòkò kay ni asé tan\r\nDé santiman violan kon nenpot ki aksidan\r\nDé tjè ki ka palé é sé bondié ki konfidan\r\nE non sa pa ni sans pou an « cerveau » ki pridan\r\nMè pou séparé yo menm lanmò pa sifizan\r\n\r\nE chak jou bondiè fè , chak i gadé’y i sé pléré  lè i ka souri ba’y\r\nI pa sav si i ka révé é pou i sèten ke sa vré fok i séré’y an bra’y\r\n\r\n\r\nREFRAIN & FIN ..\r\n\r\n\r\n\r\nPaille X DjGil - AnBray \r\n\r\nRetrouve toute l''actualité de Paille sur:\r\nFb: https://www.facebook.com/lhommepaille/\r\nTwitter: https://www.twitter.com/lhommepaille/\r\nInsta: https://www.instargam.com/lhommepaille/', NULL, 'djgil972', 0, NULL);
