(1971, 'Tourner la page', 'wO5ZEwf00N4', '2016-01-14 08:04:00', 1, 'tourner-la-page-1', 'FANDE Gissé TRAVYS', '"TOURNER LA PAGE"\r\nA/C: Gissé Travys\r\nArrangements: Gissé Travys/Donshorty/Olivier CH/Gissé Travys\r\n\r\nMixe et Master: Donshorty (assistant: Gissé Travys)\r\nChoeurs: Marielle et Gissé \r\nAnnée:2016\r\nProduction: GT\r\n[Album: prévu pour cette année 2016]\r\nClip réalisé par: Cigey Design \r\nAssistant: Ronald\r\nMise en scène: Gissé Travys\r\n\r\nDécouvrez l''intégralité du parcours de Gissé Travys au:\r\nwww.gissetravysofficiel.skyblog.com\r\n\r\nContact équipe de Martinique et de Guadeloupe: 0690 42 77 91\r\n\r\nMail équipes: staffgissetravys@gmail.com \r\n\r\nGissé remercie grandement, son Ange Gardien et son équipe de la Guadeloupe et de la Martinique.\r\n--------------------------------------------------------------------\r\n"TOURNER LA PAGE"\r\nParoles: Gissé Travys\r\n\r\nCOUPLET 1:\r\nmais qu''est-ce que je fous là?\r\nJe me demande encore! \r\nQuelle heure est-il? \r\nEt qui je suis?\r\nJe ne sais plus!\r\n\r\nCOUPLET 2: \r\nà l''amour, comme à la guerre, \r\nles coups durs, les cicatrices, \r\nsans faire de longs discours, \r\nchoisir le chemin le plus court! \r\n\r\nCouplet 3:\r\npour elle,\r\nj''ai écrit plus que des mots, une lettre.\r\nPour elle,\r\nau-dessous de mes ratures, toutes mes fautes.\r\nPour elle,\r\nmes projets, mes rêves s''arrachent et j''en crève.\r\nEt oublier toutes les liaisons,\r\nles accords de nos temps.\r\nNous demandons toutes les raisons,\r\nqui nous font nous corriger. \r\n\r\nREFRAIN:\r\nla vie est tellement,\r\ndès que tu deviens celle ou celui qui reste sincère.\r\nNe redevient pas celle ou celui qui est seul,\r\nregarde ce qui est essentiel.\r\n\r\nPONT:\r\noui, prendre son courage par la main,\r\nen découvrant le mal qu''on nous fait.\r\nPerdre tous ses rêves en chemin,\r\nautant d''amour de concessions, \r\nmais à quel prix?\r\n\r\nREFRAIN:\r\nla vie est tellement,\r\ndès que tu deviens celle ou celui qui reste sincère.\r\nNe redevient pas celle ou celui qui est seul,\r\nregarde ce qui est essentiel.\r\n\r\nREFRAIN FINAL:\r\ntourner la page,\r\nj''ai tourné la page\r\nTourner la page,\r\nil faut tourner la page.', NULL, 'cigeydesign', 0, NULL),
