(2018, 'CV', 'QknoqEFqICU', '2016-01-28 23:22:00', 1, 'cv', 'GISLANDS FILMS', 'Les armes et le beur...\r\n\r\nInstagram: Lutinofficiel_YZF\r\nRéalisation : gislandsfilms@gmail.com\r\nPAROLES JOINT CI DESSOUS .\r\n\r\nJe suis le sapin qui se cache dans ta rêfo,\r\nCette année toutes les instrus j''les ais fourré,\r\nBeaucoup parlent mais n''ont pas les mots,\r\nChacun son métier et,\r\nLes vaches seront bien gardées,\r\nPetits ruisseaux feront des grandes rivières,\r\nPetits grains de sable se transforment en pierres,\r\nPlus bas que terre, j''entends leurs prières,\r\nSi je vais en enfer, j''menfous y''a mes frères..\r\nJe profite jsuis à dix minutes de la mer,\r\nCinq minutes et voilà mon revolver,\r\nTout le monde à terre,\r\nOn sait le faire,\r\nVivre enfermer est ce que tu peux le faire ?\r\nAkunamata, loin de réalité,\r\nQue dans les dessins animés,\r\nLe papa c''est pas moi,\r\nPapa où t''es ?\r\n#Génération Stromae\r\nLa route elle à trois voies, allez circuler, \r\nles jalousins ont du toupet.\r\nUn couplet qu''on t''as craché lourd,\r\nL''instru demande à Marley,\r\nEn Janvier en Cellule, en Aout a la télé,\r\nLibérez mon armée,\r\nRaper ca devient trop facile,\r\nJ''ai écrasé la musique colis fragiles.\r\n\r\nMaman m''avait dit fumer tue,\r\nJ''ai fumé la musique j''sui têtu,\r\nJe te fuck à la folie j''ai les punclines qui tuent,\r\nNos ziks font des classiques,\r\nT''aurais jamais cru,\r\n\r\nLe curiculum on le connaît tous,\r\nCurieux est l''homme souvent ça glousse,\r\nCa à la frousse quand ça éclabousse,\r\nEt devant l''uniforme ils se mettent à tousser...\r\n100 kilos ça dit que ça pousse,\r\nPas de mouchoir quand on va le trouver,\r\nFeufeufeu faut pas que ça repousse,\r\nUne pensée pour mes frères écroués,\r\nJ''ai plus d''un tour dans ma trousse,\r\nRemercie ceux qui n''ont jamais douté,\r\nCa vole pas plus haut que mon pousse,\r\nTom est tout seul dans sa course,\r\nPetit chaton tu n''es pas un ours,\r\nTu frapperas un jour dans la brousse,\r\nSortez le larousse mon français à une cartouche,\r\nCes jours ci moi j''veux une rousse..', NULL, 'gislandsteam', 1, NULL),
