(2098, 'Je compte les jours', 'xWq5xmlSdt0', '2016-02-21 13:36:00', 1, 'je-compte-les-jours', 'Your Zouk TV', 'N''RICK - JE COMPTE LES JOURS\r\n\r\nAuteur : N''rick\r\nCompositeur: Patrick Andrey \r\nBasse : Mike Clinton\r\nGuitare : Alexandre Cabit\r\nChoeurs : Patrick Andrey / N''rick\r\nMix by DREY \r\nMastering : Yvan Charpentier\r\n\r\nRemerciements à l''équipe de l''établissement "Les Lataniers" à Piton st Leu pour leur accueil haut de gamme : http://www.les-lataniers.com/\r\n\r\nRéalisation : Lumeos production \r\nAssistant cadreur : Manimal \r\nAssistant :speed Faya \r\nAssistante : Isabelle Benard\r\nModèle : Marie Lou \r\n\r\nmerci à la team réal clip toujours présente par tout temps :) \r\n\r\nEt à la unity team présente sur tous les fronts \r\n\r\nEt surtout merci à vous qui me suivez toujours de plus en plus nombreux .\r\n\r\n         JE COMPTE ELS JOURS\r\n\r\nJ''ai ce sentiment étrange \r\nquand sur toi se pose mes yeux\r\nDans ce silence immobile comme figé sur ta beauté\r\nje compte les jours..\r\n\r\nJe t''aime le lundi ..mardi .. mercredi.. Le jeudi .. vendredi ... Le week-end aussi\r\n\r\nOui je t''aime \r\nchaque jours de la semaine\r\nOui je t''aime \r\nchaque jours de la semaine\r\n\r\nJe serai seul au monde \r\nsi tu ne me voyais pas\r\nJe pense à toi penses-tu à moi ?\r\nJe me sens seul au monde \r\nquand tu ne réponds pas\r\nJe t''en supplie mets fin à ça ..\r\n\r\nJe t''aime le lundi ..mardi .. mercredi.. Le jeudi .. vendredi ... Le week-end aussi\r\n\r\nJe n''aurai jamais pensé \r\nt''aimer si violemment\r\nEt le silence immobile \r\nne fait que parler de toi ...\r\nDis moi comment faire pour rester loin  de toi\r\n\r\nJe compte les jours .. Je compte les jours..\r\n\r\nOui je t''aime \r\nchaque jours de la semaine\r\nOui je t''aime \r\nchaque jours de la semaine\r\n\r\n\r\n Je t''aime le lundi ..mardi .. mercredi.. Le jeudi .. vendredi ... Le week-end aussi\r\n\r\nLe week-end aussi ... Le week-end aussi ... Le week-end aussi ...\r\n\r\n--\r\nYourZoukTv est la chaîne YouTube entièrement dédiée à toute la musique Caribéenne ! \r\nZouk, Dancehall, Traditions, Nouvelle scène créole, mais aussi contes, concerts, lives, Interviews ! \r\nRetrouvez tout l''esprit de la Caraïbe en quelques clics !\r\nAbonnez-vous : http://bit.ly/1gq5g8Z\r\nSITE - http://www.believedigitalstudios.com/\r\nFACEBOOK - https://www.facebook.com/YourZoukTv\r\nTWITTER - https://twitter.com/YourZoukTv', NULL, 'PATRICKANDREY6', 0, NULL),
