(2184, 'Aleka', '0hE2nXvMW5c', '2016-03-14 23:28:00', 1, 'aleka', 'Blica Family', 'Pour son nouveau titre A LEKA, Blicassty c''est entouré de Don Shorty et Radix Corporat afin de vous offrir une belle composition haute en couleur.\r\nLaissez vous emporter sur un son mélodieux remplit de vérités, rester en retrait est parfois signe de timidité ou d''observation.\r\nToutefois les nombreux phénomènes de violence qui touchent notre île découlant parfois d''une amitié ou relation intime ou plus grave entre membres d''une même famille nous donnent à nous interroger sur les relations que l''on peut avoir avec ces congénères en 2016. \r\nBon visionnage\r\nRealisation: Radix Corporat\r\nCompositeur:Don Shorty Record', NULL, NULL, 0, NULL),
