(2260, 'Faire en sorte', 'UT-tR7aWsbQ', '2016-04-06 21:41:00', 1, 'faire-en-sorte', 'Jessye Belleval', '⬇⬇⬇ RÉSEAUX SOCIAUX ⬇⬇⬇ REMERCIEMENTS ⬇⬇⬇\r\n\r\nSUIVEZ-MOI :\r\nInstagram : https://www.instagram.com/jessye_bell...\r\nTwitter : https://twitter.com/jessyebelleval\r\nFacebook : https://www.facebook.com/jessyebelleval2\r\n\r\nTÉLÉCHARGEMENT :\r\niTunes : https://itunes.apple.com/fr/album/fai...\r\nGoogle Play : https://play.google.com/store/music/a...\r\n\r\nREMERCIEMENTS :\r\nMerci à toutes les personnes qui ont participé de près ou de loin à la réalisation de ce clip, à commencer par toi Patrick (Patrick Andrey – Unity Films) eh oui ! Il réalise des clips aussi ! \r\nTu es un vrai génie !! Merci infiniment pour ce très beau clip. J’en suis plus que fière d’autant plus que ma carrière a commencé grâce à toi  (sans oublier Jim Rama) \r\n\r\nMa première scène live, c’était avec vous, il était donc évident que l’on se retrouve ici.  \r\nJ’en suis plus que ravie. Merci au groupe T’Swing !! Charles, Martin, Claude, Patrice, Claudy, Séverine et Sandra. M E R C I !!! \r\nVotre participation sur ce projet me va vraiment droit au cœur. Merci la Family !!\r\n\r\nMerci à toi David pour cette magnifique tenue – qui t’a donnée tant de mal lol\r\nEn tout cas, merci beaucoup pour ta rapidité, ta créativité et ton professionnalisme. Merci aussi de m’encourager comme tu le fais (je sais que tu ne travailles pas sans écouter du «Jessye Belleval» lool\r\nGros bisous copain !\r\n\r\nMerci Laurine (Laurine Somers – Studio Strass) tu m’as faite toute belle !! \r\nOn s’est super bien amusé lors du tournage, j’en garde un excellent souvenir.\r\nJe recommande studio strass à toutes les femmes !! \r\nLaurine s’occupera bien de vous (maquillage, remise en forme etc.…) \r\n\r\nOeil2Moy, toujours fidèle, à chaque pas, tu es à mes côtés, merci pour ta présence, ton partage et ton savoir-faire. Je te fais de gros bisous, à Lucas aussi !\r\n\r\nMerci à Didier Tabor, ta présence sur le tournage m''a vraiment fait plaisir. \r\nJe n''oubli pas Georges, merci encore !.\r\n\r\nLes titis au carré (Thierry Delannay & Thierry Robert-Naudin) – merci d’avoir mis tout votre cœur dans ce morceau !! \r\nTiti tu sais déjà  et Titi tu sais déjà lool – Trêve de plaisanteries… un travail d’équipe ; je sais que vous avez bossé avec amour sur ce single, ça s’entend ;-)\r\n\r\nMerci Pipo (Philippe Martias) toujours aussi rapide. Merci pour tes encouragements aussi !!\r\n\r\nBlombix toi aussi tu as passé des heures sur la réalisation de ce clip. Merci pour ton œil averti !! \r\n\r\nJe n''oublie pas de saluer toute la BOZ, mes frangins !! Merci de m''encourager comme vous le faites. Je suis contente de faire partie de cette belle équipe ! A vos côtés j''apprends de jolies choses ! ;-)\r\n\r\nEt enfin à toutes ces femmes qui ont marqué ma vie : \r\n• Ferlande et Marietta : mes grands-mères, défuntes, qui resteront pour moi des « poto mitan »\r\n• N’jie, vous le savez tous, je suis fan !\r\n• Sandrine, ma meilleure amie (ma dou). C''est en partie grâce à toi tout ce chemin parcouru ! \r\n• Christiane Taubira, une femme déterminée !\r\n• Edith Lefel, tu nous manques beaucoup ! \r\n• Mulâtresse Solitude : Stupéfaite de son parcours ! \r\n• Orlane, une femme au grand cœur, une artiste que j’aime beaucoup de par sa simplicité et sa tendresse\r\n• Florelle Benjamin, écrivain – son livre « ainsi soit sans fils » qui m’a beaucoup touché. Je vous le recommande\r\n• Geneviève, ma maman d’amour, je t’aime à l’infini !!\r\n• Eileen, ma fille, la force incarnée. Mon rayon de soleil, je t’aime ma princesse.\r\nLe mot "aimer" a pris toute sa puissance le jour où tu es entrée dans nos vies.\r\n\r\nMerci à vous tous qui me soutenez chaque jour un peu  plus ; ma  #JessTeam.  \r\nJe vous aime !!\r\n\r\n\r\nPAROLES : \r\nhttps://m.facebook.com/story.php?stor...', NULL, NULL, 0, NULL),
