(2267, 'Je serai là', '6TCZuXA1zfU', '2016-04-09 13:21:00', 1, 'je-serai-la', 'Admiral T Officiel', '" Je serai là " disponible sur l''album I AM CHRISTY CAMPBELL disponible dans les bacs et en téléchargement légal : http://smarturl.it/admiraltiacc\r\n\r\nAbonnez vous à la chaîne youtube : http://bit.ly/AdmiralT971\r\n\r\nRejoignez ADMIRAL T sur Facebook - http://www.facebook.com/admiralt971\r\n\r\nSuivez ADMIRAL T sur Twitter - http://twitter.com/admiralt971\r\n\r\nAbonnez-vous à ADMIRAL T sur Instagram - http://instagram.com/admiralt971\r\nCatégorie\r\n\r\nSuivez Admiral T sur Sound Cloud https://soundcloud.com/admiral-t\r\n\r\n" Je Serai là "                          \r\n\r\nEt j''entends parler de pères de papas qui n''assurent pas\r\nEn ce qui me concerne le mien a toujours été là pour moi\r\nTravailler transpirer non cela ne m''effraie pas\r\nFournir des efforts par amour rien que pour toi\r\n\r\nPère attentionné \r\nParfois dur et sévère \r\nPour toi\r\nImpliqué et dévoué\r\nUn père exemplaire juste pour toi\r\n\r\nREFRAIN \r\nTes premiers pas\r\nTes premières fois\r\nTes premières larmes\r\nAuprès de toi ne t''inquiète pas\r\nJe serai là\r\nTes échecs et tes victoires\r\nMême tard le soir \r\nDès que t''auras besoin de moi\r\nJe serai là\r\n\r\nConsidère moi comme ton meilleur ami\r\nTon père les deux à la fois\r\nQuand tu souffres je souffre en même temps que toi\r\nToi la chaire de ma chaire le sang de mon sang\r\nPour toi je ferai n’importe quoi\r\n\r\nREFRAIN \r\nTes premiers pas\r\nTes premières fois\r\nTes premières larmes\r\nAuprès de toi ne t''inquiète pas\r\nJe serai là\r\nTes échecs et tes victoires\r\nMême tard le soir \r\nDès que t''auras besoin de moi\r\nJe serai là\r\n\r\nEt j''entends parler de pères de papas qui n''assurent pas\r\nEn ce qui me concerne tout ce qui m''importe sur terre c''est toi\r\nTravailler transpirer non cela ne m''effraie pas\r\nFournir des efforts par amour rien que pour toi\r\n\r\nREFRAIN \r\nTes premiers pas\r\nTes pre