(2278, 'Brisée', 'dD-XI7YHXY4', '2016-04-12 07:16:00', 1, 'brisee', 'Cila Tight', 'Titre : Cila Tight - Brisée\r\n\r\nAuteur : Cila Tight\r\n\r\nCompositeur : O.M.C Music Malor Beats\r\n\r\nRéalisateur : KMF Production\r\n\r\nScénariste : Wanted Production ( Dj YoT )\r\n\r\nGroupe : IMPERIAL Group Music\r\n\r\nMaquilleuse : ALIpstick ( Page Facebook)\r\n\r\nAnnée : 2016\r\n\r\nLien de téléchargement : \r\nSouncloud : https://soundcloud.com/ilaight/cila-tight-brisee-prod-by-wanted-mars-2016\r\nMediafire :  http://www.mediafire.com/download/qp23n2psxc97nwv/CiLa_Tight+-+Bris%C3%A9e+%28Prod_by_WanTed%29+Mars+2016%282%29.mp3\r\n\r\nSuivez mes actualités via :\r\n\r\nFacebook : Cila Pris\r\nPage Fan Facebook : Cila Tight\r\nTwitter : Cila Tight\r\nInstagram : Cila tight\r\nSnapchat : Cilatight\r\nPériscope : Cila_Tight\r\nPage Facebook : IMPERIAL Group Music\r\n\r\nEmail for booking : cila-tight.booking@hotmail.com\r\n\r\nDescription :\r\n\r\nJ’ai le plaisir de vous faire découvrir mon nouveau titre “Brisée” extrait de mon single “ Triste Vérité” .\r\nChaque jour dans le monde des femmes meurent suite à des violences conjugales. Les chiffres n’arrêtent pas d’augmenter jour après jour.\r\nIl est très difficile pour ces femmes de se confier et de dénoncer ce qu’elles subissent au quotidien par peur de représailles ou peur du regard d’autrui. Elles sont très souvent renfermées dans leur désespoir et oubliées par le système. Certaines arrivent même au stade du suicide en laissant derrière elles des enfants en bas âge.\r\nUnissons nos forces afin que ce phénomène diminue et que ces femmes brisent enfin le silence avant qu’il ne soit trop tard. \r\nSoyons attentif tous ensemble.', NULL, NULL, 0, NULL),
