(2345, 'M''moi', '83_oTDVFO_Y', '2016-04-28 00:04:00', 1, 'm-moi', 'RAW Musik', 'Découvrez le dernier morceau de Mayerline Feat. Mainy : M''Moi.\r\n\r\nAUTEUR/ MAINY\r\nCOMPOSITEUR/MAINY\r\nCHOEUR / SYNNTYA\r\nINTERPRETES / MAYERLINE - MAINY\r\nARRANGEUR  / W+\r\nGUITARE / OSCAR MICHAUD\r\nREALISATEUR TITRE /MAINY\r\nMIX /THIERRY ROBERT NAUDIN\r\nMASTERING / PM STUDIO\r\nEDITEUR  /DENADA PUBLISHING\r\nREALISATEUR  / RADIX CORPORATION \r\nCO REALISATEUR /MPIX\r\nSO FRESH BARBER \r\nMAKE UP  / STEPHANIE LOUIS CALIXTE\r\nSTYLISME/ LUXURY BY CHRISTIANE VALLEJO\r\nHOUSSE OF LORD / BY L EMPEREUR\r\n\r\n\r\nBooking Mayerline : noriane.manag.rawmusik@gmail.com\r\nContact : Rawworldmusik@gmail.com\r\nFacebook / Instagram / Twiter : Mayerline Officiel\r\nYoutube : Raw Musik\r\n\r\nRaw Musik est un label indépendant de développement et de production musicale, qui à pour objectif de faire émerger des nouveaux talents.\r\nCréé en 2013, Raw Musik souhaite injecter du sang frais au sein de l''industrie musicale et modifier les tendances en mettant en avant et en faisant le « buzz » autour d''artistes prometteurs, afin de séduire un large public.\r\nFacebook Raw Musik : https://www.facebook.com/rawmusik/?fref=ts\r\nFacebook Mayerline : https://www.facebook.com/Mayerline-708132029294399/?fref=ts', NULL, NULL, 0, NULL),
(2346, 'Pa si move', '2TjQPyK6o28', '2016-04-28 00:05:00', 1, 'pa-si-move', 'Mainy touch', 'Découvrez le dernier clip  de K-REEN et MAINY: "PA SI MOVE", feat. MAINY\r\nAprès le succès de « JE SAIS », redécouvrez l’association à succès : voix de K-REEN / composition MAINY TOUCH. Le duo terrible du Zouk revient avec ce titre aux sonorités kompa pour notre plus grande satisfaction !\r\nAuteur : MAINY\r\nCompositeur : MAINY / DORY\r\nGuitare : OSCAR MICHAUD\r\nMix & Mastering : FRANCOIS FOURLIN\r\nDenada Publishing\r\nCommunication / Relations Presse : KARYNE MAC pour KARYNE MAC’OMMUNICATION – karyne.mac.communication@gmail.com - +33 6 35 27 62 79\r\nBooking: 0614934362\r\nRealisteur Mpix/Radixcorporation\r\nCadreur: Lagriff\r\nMake up :Noemie Certain\r\npartenaires/Myoptic,Housseoflords,Luxurybychristianevallejo,chabineprod,jetcaraibesprost,sofreshbarber, \r\ndjStonekilla\r\n\r\nPA SI MOVE \r\nJe suis la seule à vivre notre amour \r\nMais toi tu ne le vois pas \r\nJ''suis fatiguée d''être ta roue de secours Je ne peux plus vivre comme ça \r\nTu m''appelles que pour m''faire l''amour J''suis pas une tainp déjà \r\nSi je pars je f''rais plus demi-tour \r\nAlors s''te plaît dis moi\r\n\r\nREFRAIN\r\n\r\nYo di mwen mwen pa méritéw sé tchè mwen ki pa bon \r\nÉ poutan sé mwen ou lé \r\nMwen ni lanmou maladwèt ou ka pléré yo ka di sé mwen ki mové\r\nYo di ou pa mérité mwen \r\nSé fon tchèw ki pa bon é poutan a to mo lé - oh nonnn \r\nTo gain lanmou maladwèt mo ka pléré Yé ka di a to ki mové \r\nMwen pa si mové\r\n\r\nJe t''aime fort mais est-ce à sens unique Où sont ces moments où j''étais ta blue magic \r\nJe perds mon coeur sans toi ohh waaa J''ai tout misé sur toi ohh waaa \r\nEn mode saoulée quand tu fais le MG (Mauvais Garçon) \r\nMais me respecter c''est te respecter Mon coeur se bat dans tous les sens \r\nSi le tien est en guerre on n''a aucune chance\r\n\r\nREFRAIN\r\n\r\nYo di mwen mwen pa méritéw sé tchè mwen ki pa bon \r\nE poutan sé mwen ou lé \r\nMwen ni lanmou maladwèt ou ka pléré yo ka di sé mwen ki mové\r\nYo di ou pa mérité mwen \r\nSé fon tchèw ki pa bon é poutan a to mo lé - oh nonnn \r\nTo gain lanmou maladwèt mo ka pléré Yé ka di a to ki mové \r\nMwen pa si mové\r\n\r\nSé lanmou ki ka chapé an tchè ki pa ka tchimbé \r\nDi mwen si lanmou mô Pou mwen pé chaviré \r\nSé lanmou ki ka chapé an tchè ki pa ka tchimbé An sèl bagay mwen lé sé ou pou mwen rété\r\n\r\nREFRAIN', NULL, NULL, 0, NULL),
(2347, 'En sel Fwa', 'kiVBE_5d6Sc', '2016-04-28 07:15:00', 1, 'en-sel-fwa', 'Your Zouk TV', 'Chanteuse originaire de la  Martinique. Très jeune, elle  découvre une passion  pour la musique  et la danse.  A ses débuts pour le plaisir, elle participe sur diverses compilations (Reggae, dancehall, coupé décalé...) en tant que choriste et  sur quelques featurings.\r\n\r\nUne expérience très riche, particulièrement celle qu''elle a pu avoir en travaillant avec de grands artistes d''origine Africaine tels que, David TAYORAULT, Ziké, Ousmenez...\r\nElle a  pu lors d''une tournée en Côte d''ivoire en compagnie de Betty MABEA, présenter un de ses titres qui n''était alors qu’une maquette, ce fut une première grande expérience  avec un très grand public chaleureux.\r\n\r\nUn déclic, qui l’a motivé, à enfin se lancer en solo.\r\nUn premier single sort  en 2013  « My baby love »  qui lors d’une prestation à la fête de la musique du  VAUCLIN, lui permettra de se faire repérer, par Stéphane MOREAU (artiste), qui lui propose une composition zouk.\r\n\r\nUne belle rencontre qui lui permettra de se faire une place dans le milieu du zouk  et de commencer une nouvelle aventure, en collaborant  avec de nombreux  artistes (Dave Pierre Louis, Elie Louisy, Donshorty, Yann Nosel…)\r\n\r\nActive et productrice aujourd''hui,  elle arrive avec  un style plus personnel et  nous propose prochainement un album de 8 titres,  on y trouvera un mélange de mélodies aux textes variées.', NULL, NULL, 0, NULL),
