(2363, 'Kafrine', 'sDyBcDC_k9s', '2016-05-01 21:07:00', 1, 'kafrine', 'MaylodiscProduction', 'Soutenez vos artistes en achetant le single avec les liens ci dessous:\r\nItunes: https://itun.es/fr/6xQsbb?i=1095411626\r\nGoogle Play: https://play.google.com/store/music/album?id=Bh7iuexnizukd7bdyqgr67jmqne&tid=song-Tggpihrqoaaiuyceaiunhtcotxa\r\n\r\nFacebook Ben-G: https://www.facebook.com/BENG973/\r\nFacebook Jona: https://www.facebook.com/Jona-110213575702890/\r\n\r\nCompositeur: Dj Laconi (Adi Mix Production)\r\nAuteurs: Ben-G, Jona, Seeven Vima, Sharky FNZ\r\nInterprètes: Ben-G & Jona\r\nRecord & Mix: Doc P ( https://www.facebook.com/DocPRecMix/ )\r\nMastering: PM Studio\r\nMake Up: Guewen Glossy\r\nEquipe Vidéo: Hope Vidéos\r\n© Maylodisc Production / Maylodisc Production974\r\nISRC: FR-26V-16-15596\r\nContact & Booking: B-Low 06.78.36.69.44 / maylodisc@gmail.com\r\n\r\nParoles Ben-G Feat Jona - Kafrine (96 BPM)\r\n\r\nIntro:\r\nAgain and again again\r\nOuh Ouh Ouh Ouh\r\nYeah hey hey hey\r\nJona Ben-G\r\nWo wo wo woy\r\nB E N – G\r\nGimme gimme now\r\nJona again again and again\r\nDj Laconi\r\nMaylodisc Production\r\nElle est tout c’que j’aime\r\n\r\nCouplet 1 Ben-G:\r\nElle est tout c’que j’aime\r\nDouce comme un ange\r\nForte comme une reine\r\nDans son royaume elle m’emmène \r\n\r\nOui \r\nElle est tout c’que j’aime\r\nQuand nos corps se mélangent\r\nRien ne l’arete au 7éme ciel elle m’enmene\r\nOui \r\nElle est tout c’que j’aime\r\nRouge jaune blanche ou encore noir comme l’ébene\r\nOui elle est tout c’que j’aime\r\nJamais je ne lui ferais de la peine\r\n\r\nElle est ravissante \r\nEblouissante\r\nOui baby shine like a star\r\nCette femme est etourdissante\r\nElle est sexy wicked \r\nMais elle reste descente\r\nElle lis dans mes pensées non pas besoin \r\nQue je lui mentes\r\n\r\nCette gyal est si forte comme Rambo\r\nC’est un soldat\r\nMiss independante elle a l’ame d’un vrai leada\r\nReyel championne\r\nElle baisse jamais les bras bas bras\r\nNon y’en as pas