(2364, 'Ame soeur', 'V4tG9gxgTas', '2016-05-02 07:27:00', 1, 'ame-soeur', 'CHABINE PROD', 'Abonnez-vous à la chaîne officielle de Chabine Prod : http://bit.ly/chabine-prod\r\nEt sur les plateformes suivantes :\r\n-Amazon : http://bit.ly/chbnprod\r\n-Facebook : http://bit.ly/chabineprod\r\n-Twitter : http://bit.ly/chabinetwitter\r\n\r\n\r\nUne voix de crooner envoutante. Découvrez la personnalité toute en love et tendresse de Nicolas Largen, du groupe Madinn''K, qui se lance, avec succès, en solo.\r\nDisponible en téléchargement légal\r\nLien iTunes : https://itunes.apple.com/ca/album/ame...\r\nRéalisation: Radix Corporation\r\nProd Chabine Prod\r\nEditions De Nada Publishing\r\n\r\nMerci à:\r\n- Make Up by Noémie Certain\r\n- Figurante: Gessia Grangenois \r\n- Association Kiz''Easy (0696038731)\r\n- Mercedes Martinique\r\n- Lissac Rond-Point\r\n- Dim Audioconcept\r\n- Frédéric Louis-Sydney\r\n\r\n\r\nAME SŒUR\r\na/c Nicolas LARGEN – Jerome GAMALAME\r\n\r\nEy oh oh\r\nQuand tout va mal, babe\r\nTu me rassures encore une fois\r\nEt ça fait mal, quand tu t’éloignes parfois\r\nSi par hasard, babe, l’amour s’essouffle encore une fois\r\nJuste un regard\r\nOu séré mwen pli fo mais viens\r\nBébé je t’aimerai toujours\r\nTu verras que notre amour durera jusqu’à la nuit des temps\r\nViens, j’te prouverai mes sentiments\r\nJ’te f’rai vibrer comme ça doucement\r\nQue je sois l’homme qui te comblera\r\nA jamais\r\nA jamais\r\nOuh à jamais\r\n\r\nSi ou biswen lanmou an jou\r\nDoudou di mwen’y\r\nDi mwen’y\r\nE si’w biswen mwen pou toujou\r\nMan ké pli pré’w\r\nMan ké pli pré’w\r\nMèsi pou tou sa ou ba mwen san sipoté\r\nAn fon tchè mwen man ké gravé\r\nNon’w pou léternité\r\n\r\nViens Baby je t’aimerai toujours\r\nTu verras que notre amour durera jusqu’à la nuit des temps\r\nViens, j’te prouverai mes sentiments\r\nJ’te f’rai vibrer comme ça doucement\r\nQue je sois l’homme qui te comblera\r\n\r\nEt si on prenait le temps de savourer chaque instant « a jamais »\r\nOublions nos vi