(2401, 'Gwo Ka Remix', 'pIF9llEydjo', '2016-05-11 23:01:00', 1, 'gwo-ka-remix', 'Your Zouk TV', 'Le single "Gwo Ka Remix" est disponible sur iTunes, Deezer et Spotify : https://itunes.apple.com/fr/album/gwo-ka-feat.-erik-negrit-misie/id1112272714?app=itunes&ign-mpt=uo%3D4\r\nhttp://www.deezer.com/playlist/1390499535?utm_source=deezer&utm_content=playlist-1390499535&utm_term=742077665_1462839372&utm_medium=web\r\nhttps://open.spotify.com/user/couleursmusicpublishing/playlist/6EgSilKIRuRkqMfbqm987A\r\n\r\nL''incontournable sérial lover poursuit sa récolte de tubes ....dans un répertoire déjà impressionnant !\r\nAvec un hommage au Gwo Ka musique traditionnelle (inscrite au patrimoine de l''Unesco) de son île la Guadeloupe.\r\n\r\nC''est aussi un clin d''oeil à l''abolition de l''esclavage dans certains territoires des Dom Tom :\r\n\r\n- Guadeloupe 27 mai\r\n- Martinique 22 mai\r\n- Guyane : 10 Juin\r\n- Réunion 20 décembre....\r\n\r\nMedhy Custos "Gwo Ka Remix" accompagné de l''une des plus belles plumes du Rap Kréol,Misié Sadik et l’infatigable défenseur de la tradition\r\nde la Guadeloupe Erik Négrit.\r\n\r\nProductions SINKEKAT Productions/ Couleurs Music Publishing\r\nRéalisation: ZANDOLI Productions\r\n\r\nGWO KA REMIX\r\nInterprètes MEDHY CUSTOS - ÉRIK NÉGRIT-MISIÉ SADIK\r\nA: MEDHY CUSTOS-MISIÉ SADIK\r\nC:KRONOFACE-MEDHY CUSTOS-MISIÉ SADIK\r\nArr:CHÉRUBIN Cedric ( Gwadvibes )\r\n\r\nRemerciements\r\n\r\nROYAL OPTIC , INSPIRATIONS, ESPACE AFRICAIN, LA KLÉ\r\nRAYMONDE TORIN- PATER (KAMODJAKA), Teddy PELISSIER (NJK), ASSOCIATION Bel''kapress, Patrick LOLIA ,\r\nFanswa Ladrezeau et MOUVMAN KILTIRÈL AKIYO,\r\nYves THOLE ,Jacqueline CACHEMIRE THOLE ( AKADÉMIDUKA ),\r\nGRIV'' LA, Groupe NANM'', DJ WILSON, INSIDE CREATIVE STUDIO,\r\nLigne De Créa, Studio BABY BOYS MUSIC.\r\n\r\nAbonnez vous aussi sur le Facebook et Twitter de Couleurs Music Publishing :\r\n\r\n- Facebook: https://fr-fr.facebook.com/Couleurs.Music.Publishing.Ltd\r\n- Twitter: https://twitter.com/couleursmusic', NULL, NULL, 1, '2016-05-14 00:01:51'),
