(2413, 'Au dessus du soleil', '0dGTGourCfY', '2016-05-15 17:21:00', 1, 'au-dessus-du-soleil', 'AZTECMUSIQUE', 'En attendant le prochain album de Talina, découvrez son nouveau single "AU DESSUS DU SOLEIL". À trop vouloir voler près du soleil on peut se brûler les ailes et oublier les amis qui étaient avec vous en bas de l''échelle...\r\n\r\nSuivez toute l''actualité de Talina sur les réseaux sociaux:\r\nInstagram: @Talina_Lyse\r\nFacebook: https://m.facebook.com/talinaOfficiel\r\n\r\nContact Management: Sandra "Cookie" Menal  06 82 88 01 39 cookiiebooking@gmail.com \r\n\r\nAttachée de presse: Rebecca Marival\r\n\r\nProduction: Aztec Musique\r\n\r\nCrédits:\r\nAuteurs: Talina Lyse, Lyvia Putola\r\nCompositeurs: Talina Lyse, SRGMAKER \r\n\r\nRéalisation: Jima Kanor\r\nPhoto: Rikko Ross et RGK Photographie\r\nStylisme: Honorine B\r\nMUA: Gladys et Anne Pagis\r\nCoiffure: Fred Fenine \r\nTresses: Kaboom pour WELLY STYLE\r\nCollaboration: UNITYX\r\nGuest: Imélie Monteiro, Lyvia Putola et Kiirikou\r\nFigurants: Cherine (l''amie devenue chanteuse), Sandra Collé (le manager), SRGMAKER (l''ingénieur du son), Jessica KJC (la maquilleuse), Audrey Dangeros (la coiffeuse), Gregory Giraud (l''assistant de production), Yoan Blimer (le photographe), Mylène et Théo (les fans au restaurant), Anaïs Hervy (figurante dans le restaurant)\r\n\r\nRestaurant L''ANGELUS, 121 rue St Jacques, 91150 Étampes \r\n\r\nParoles:\r\nLe temps change parfois les vies,\r\nLe succès peut séparer des amis\r\nQui aurait crû que tout ça serait fini?\r\nLA VIE EST UNE BELLE IRONIE, JE T''ASSURE\r\nJe t''assure que tu passais avant tout, à l''usure oui tu m''as mise à bout\r\nNotre amitié était pourtant si belle, on était au sommet, plus haut c''était le soleil\r\n\r\nSI AN MOUN TÉ DI MWEN KÉ NOU PA TÉ KAY ZANMI ENKO\r\nJ''aurais dit non non non \r\n\r\nJe t''ai sûrement mal jugé, finalement le voile s''est levé\r\n\r\nRefrain\r\nJ''te laisse voler au dessus du soleil\r\nEN HAUT, EN HAUT OH, EN HAUT, EN HAUT OH\r\nTu m''diras si la vue y est plus belle\r\nGare à la chute à ton réveil\r\nTU M''CHERCHERAS, TU M''TROUVERAS PAS ET RIEN N''SERA PLUS PAREIL\r\n\r\nTALINA, TALINA\r\nT''es une sœur pour moi\r\nAie confiance en moi\r\nJ''ai besoin de toi, fais ci, fais ça FISSA FISSA\r\nTALINA TOI ET MOI, on va réussir\r\nTALINA TALINA, j''peux pas te mentir\r\nT''AS PERDU LA MÉMOIRE\r\nN''OUBLIE PAS D''OÙ ON EST PARTIS\r\n\r\nRefrain\r\n\r\nJ''te laisse vaquer à tes occupations, sache que la vie m''a donné une belle leçon\r\nJE T''AI SUIVI SANS MÊME ME POSER DE QUESTION\r\nOui je t''ai sûrement mal jugé\r\nFINALEMENT LE VOILE S''EST LEVÉ\r\n\r\nRefrain', NULL, 'aztecmusique;RebeccaMarival', 0, NULL),
