(2425, 'Sous son regard 9', 'ELETNqKjAyA', '2016-05-18 07:50:00', 1, 'sous-son-regard-9', 'FANDE Gissé TRAVYS', '"SOUS UN REGARD 9" \r\nAuteur: Gissé Travys\r\nCompositeur: Gissé Travys\r\nArrangements: Gissé Travys/DonShorty/Gissé Travys\r\nMix et Master: DonShorty et Gissé Travys\r\nChoeurs: Gissé Travys\r\nProduction: Gissé Travys\r\nAnnée: 2016\r\nAlbum: prévu fin 2016\r\nClip réalisé par: DonShorty\r\nDirection Artistique Clip: Gissé Travys\r\nLumières et Technique lumières: Manuel C\r\nTechnicien : J-Maurice O\r\nMetteur en scène: Gissé Travys\r\nLieu de tournage: Au TOM (Merci beaucoup aux responsables des lieux)\r\n\r\nDécouvrez l''intégralité du parcours de Gissé Travys de 2008 à 2016 sur le:  www.gissetravysofficiel.skyblog.com\r\n\r\nMail équipes: staffgissetravys@gmail.com \r\nTel équipes: 0690 42 77 91\r\n\r\n"SOUS UN REGARD 9"\r\nA/C: Gissé Travys\r\n"Cette chanson est le reflet du parcours de Gissé Travys depuis 9 ans dans la musique".\r\n\r\nREFRAIN:\r\n1,2,3, mon rêve devient réalité,\r\n4,5,6, grâce à Dieu je chante toujours,\r\n7,8,9, sous un regard 9, je vis d''amour,\r\nvous êtes mon réconfort de plus en plus fort\r\nje chante encore,\r\nquelques mots tendresse, \r\npour vous dire merci!\r\n\r\nCOUPLET 1:\r\nToi qui n''es qui plus là,\r\ncette voix souviens toi,\r\ncelle que tu aimais,\r\nelle te dit merci,\r\ntoi qui es toujours là, \r\ndepuis toutes ces années,\r\nmerci pour ton amour, tes prières, ta foi en moi.\r\n\r\nREFRAIN:\r\n1,2,3, mon rêve devient réalité,\r\n4,5,6, grâce à Dieu je chante toujours,\r\n7,8,9, sous un regard 9, je vis d''amour,\r\nvous êtes mon réconfort de plus en plus fort \r\nje chante encore,\r\nquelques mots tendresse, \r\npour vous dire merci!\r\n\r\nCOUPLET 2:\r\nLa vie me sourie,\r\nou me blesse,\r\nje fais mes choix,\r\nparfois j''en paie le prix!\r\nQuand je suis sur scène,\r\nje chante avec mon âme,\r\nma plus belle histoire d''amour c''est vous! \r\n\r\nREFRAIN:\r\n1,2,3, mon rêve devient réalité,\r\n4,5,6, g