(2436, 'C''est Dommage', 'QDNXRqHf5kg', '2016-05-20 19:58:00', 1, 'c-est-dommage', 'AZTECMUSIQUE', 'C’est Dommage : Auteurs - Marvin Yesso/ Lynnsha Jordier \r\nCompositeur : Marvin Yesso / DJ Laconi \r\nEn attendant le 5e album solo de Lynnsha … \r\nUne séparation fait toujours mal, on pense ne jamais pouvoir s''en remettre, et on se dit "c''est dommage".... Malgré tout la vie continue et les amis aident à retrouver le sourire! La vie nous réserve tant de belles surprises... \r\nCoiffeur :Shoko \r\nMake UP : laureen / Mikaelle Pamphile \r\nStylisme : Glam Ethnik By Ayden \r\nActeur: Tony Pirata \r\nFigurantes : Guylaine CLÉRY /Peggy Henri /Mikaëllle Pamphile /MC Miré /Ludivine Rétory / Sandra Archimède /Ayden/ Magali Monel / Shynis Singhavara \r\n\r\n\r\nMerci à Marvin pour cette superbe collaboration et cette belle chanson . Merci à toute l''équipe d''Aztec musique et à mon manager GUYLAINE CLERY de m''avoir soutenue pour ce projet et d''avoir permis qu''il se réalise. \r\nA mon attachée de presse Rebeca MARIVAL pour être toujours au taquet. A Armel de « Première Prise" et toute son équipe pour ce magnifique clip "ahhhh je t''ai bien saoulé lol’', NULL, 'aztecmusique', 1, '2016-05-23 23:46:15'),
