(2442, 'Pé Pa Kompwan', 'ryrl0uQZZFU', '2016-05-22 14:23:00', 1, 'pe-pa-kompwan', 'Mista Deezy Officiel', 'Titre extrait de la mixtape "N.E.S & Mista Deezy - Rèv & Espwa" disponible sur:\r\n\r\nItunes: https://itunes.apple.com/fr/album/rev-espwa/id1098805177?app=itunes&ign-mpt=uo%3D4\r\nSpotify: https://open.spotify.com/album/19M6F5hNb0cMZHGBWcMd1d\r\nDeezer: http://www.deezer.com/album/12758944\r\n\r\nProduit par Bastokova\r\n\r\nParoles:\r\n\r\nRefrain: Pé pa kompwan siw pa ka viv li du,\r\nsacrifis pou viv dé fwa ka fin vite,\r\nplis ka détwui yo la, pa la lè fo konstwui,\r\nakéri konésans pa kwè ou ké viv li,\r\nkwè an mwen kon yo réyisit ni plisiè pot,\r\ntoujou fanmi, zanmi, fanm dèyè pot fèmé,\r\nou ké sousé kok mol yenki vi la ki bandé,\r\npryé Jesus Christ frè mè sav kaw kay mandé\r\n\r\n1er couplet: Les négros sont dans la street dealent du crack et braquent,\r\non regarde l''avenir avec des black rayban,\r\ntout est noir, tout est sombre, tout est black et mate,\r\ntout est fait pour couler cette génération qu''elle craque et die...\r\nfuck leur politique à 2 balles, fuck hollande et valls\r\nles négros font les durs pendant que des tass les charment\r\net passe les liasses,\r\nqu''on fly, efface les drames,\r\nqu''on parte et trace les gars,\r\ncombattre et shlass les shlags,\r\nfaire du fric, devenir riche s''offrir une bugatti,\r\nça veut mener la belle vie sans se bouger le cul l''ami,\r\nplus ça biz, plus ça deal, plus les flics s''avancent,\r\nplus tu brille, ça excite ces petites balances,\r\ntéma ces p''tites salopes,\r\npoukaver des frères pour du pèse ils ne disent pas non,\r\nsa sé pussy pa nonm,\r\nça prend du ferme, boug déter, on les baise, on les dead et on file vite, gz dans un bolide allemand.\r\n\r\n2e couplet: Laisse les faire la guerre des gangs ils vont tous canner\r\net aucun n''aura la carrière de Tupac l''ami,\r\ntoute l''année, l''état s''en fout t''la met,\r\nbien profond et les frères finissent en zonz charmés,\r\npar la mélodie du chant des sirènes du sheitan,\r\ntu pensais t''en tirer mais ils sont venu chez toi,\r\ndevenu magicien ça fait des tours de passe passe,\r\n22 il y a flics ça finit en cache cache,\r\nentouré de fils de pute qui veulent ta chute,\r\nces négros veulent pas le faire mais veulent ta tune,\r\nça fini en fait divers en fin d''actu,\r\nt''a voulu jouer, tu perds maintenant t''assume,\r\nj''espère que God me guide,\r\nhors de la merde, on reste fort, solide,\r\nj''veux du bif pour que mes filles deviennent des gosses de riche,\r\nà la fin ça finit mal personne n''est mort de rire,\r\net beaucoup n''ont pas envie font juste l''effort de vivre.\r\n\r\nRetrouvez tous nos clips dans cette playlist: https://www.youtube.com/playlist?list=PLEcylbLRJ3Tgqy6rIW0Sy3PZfu02_heFD\r\n\r\nEt toutes nos mixtapes içi:\r\n\r\nN.E.S & Mista Deezy - Another Side:\r\n\r\nItunes: https://itunes.apple.com/fr/album/another-side/id1073596320?app=itunes&ign-mpt=uo%3D4\r\nGoogle Play: https://play.google.com/store/music/album/N_E_S_Mista_Deezy_Another_Side?id=Bzosmhdhqlmaloifibpadlws72u&hl=fr\r\nDeezer: http://www.deezer.com/album/12152984\r\nSpotify: https://open.spotify.com/album/1bMVeJHNXsvP7aTbfwyBwU\r\n\r\nN.E.S & Mista Deezy - Shine\r\n\r\nItunes: https://itunes.apple.com/fr/album/shine/id1032806778\r\nSpotify: https://open.spotify.com/album/1BfglDlE03NFujqdwfuY6K\r\nDeezer: http://www.deezer.com/album/11073658\r\nGoogle Play: https://play.google.com/store/music/album/N_E_S_Mista_Deezy_Shine?id=Bxmkhpht75thp56mio5sbmmxbui&hl=fr\r\n\r\nLaTeam - Hot Niggaz Reloaded:\r\n\r\nItunes: https://itunes.apple.com/fr/album/hot-niggaz-reloaded/id1022309954\r\nGoogle Play: https://play.google.com/store/music/album/LaTeam_Hot_Niggaz_Reloaded?id=B54f5ik4w6zwqdnggli2hvasbcq\r\nDeezer: http://www.deezer.com/album/10883324\r\nSpotify: https://play.spotify.com/album/3oCkqqQwSyme7Ly8pW3pTH\r\n\r\nMista Deezy - Believe In Your Dream:\r\n\r\nItunes: https://itunes.apple.com/fr/album/id1017866239\r\nGoogle Play: