(2479, 'Lanmou piloté', 'i2P936L-SCg', '2016-05-30 21:42:00', 1, 'lanmou-pilote', 'Darius Denon', 'Lanmou Piloté, sorti le 20 Avril 2016\r\nAuteur/Compositeur : Darius DENON / Steeve PIERRE-LOUIS\r\nProgrammation/Arrangements Claviers : Steevy\r\nChoeurs : Béatrice POULOT, Darius DENON\r\nArrangements Vocals : Darius DENON\r\nProducteur : Darius DENON\r\nRéalisateur : ​Frequence Movies\r\nMake Up : Agnès BERNARD\r\n\r\n LANMOU PILOTÉ\r\n ( A/C : Darius DENON /Steeve PIERRE-LOUIS )\r\n\r\nO fon , o fon , o fon\r\nOu té vlé jété mwèn\r\nO fon , o fon , o fon\r\n\r\nLè ou viv épi on mou''n\r\nÉw fin''n dékouvè\r\nLanmou ou konpran''n ki té réyèl  té ja piloté\r\nSa té ranjé\r\nYo té ja bouché zyé aw, ou té kondissyoné\r\nOu té ja anchéné\r\nJôdi ou vé détwi mwèn \r\nPàs Bondié tiré mwèn la\r\nOu dwèt ka rékolté saw simé \r\n\r\nOn lanmou , ki ja piloté\r\nPé pa kontinyé\r\nDépiw ni Bondié ,avèw , avèw\r\n\r\nOu ka priyé Dié soi disan\r\nMé an mèn''m tan ou ka joué \r\nAn jadèn a satan\r\nOu ka fèw passé pou on gran vikti ''m\r\nMé si sèlman yo té sav \r\nAn ki jan l''an mèn aw\r\nPa kleen , i pa kleen \r\n\r\nSé adan sé moman la sa\r\nOu ka vwè fon a kè a mou''n\r\nMé ou , té ni di mal a réalizé\r\nNi dé mou''n vréman méchan \r\n\r\nMalgré tou sa ou fè pou mèt bâton an rou an nou\r\nLanmou ké gannyé, ké gannyé                                  ( Bis )\r\n\r\nJ''n''imaginais même pas \r\nQu''un jour j''aurais tant besoin d''elle\r\nElle vivait dans son univers\r\nSi loin de moi\r\nJ''n''imaginais même pas \r\nQu''un jour je l''aimerais \r\nQu''elle deviendrait \r\nCelle dont j''ai tant rêvé \r\n\r\nElle est ma vie ( x 4 )\r\nKi ou lé , ki ou pa lé\r\nOu pé di sa ou vlé \r\nOu pé fè sa ou lé yéèh\r\nVi an mwèn, sé tan mwèn \r\n\r\nPa la pèn''n palé si mwèn \r\nSali nom an mwèn \r\nTou sé la ka jigé sans sav''\r\n\r\nSuivez Darius DENON :\r\nTwitter : @ddcool5\r\nFacebook : darius denon\r\nInstagram : \r\n\r\nSingle " Lanmou piloté " disponible sur I tunes :https://itunes