(2482, 'Trouver Les Mots', '3-l4V23qr88', '2016-05-31 07:20:00', 1, 'trouver-les-mots', 'Your Zouk TV', 'Le nouveau tube de Viviane CADRAN s''intitule "Trouver les mots"\r\n\r\na/c Jean-Marie RAGALD\r\nProd Vika Prod\r\nRéalisation Stemor\r\nISRC FR9P21600131\r\n\r\n\r\nRemerciements\r\nR''Ryel Esthétique\r\nDancing Bulbs\r\nMagyu & Charly\r\nAxel et Sonny\r\nmarclorenzskicloudytimelapse\r\nLe site Mazwai\r\nEast West Production\r\nThe Sunshine State Sail Away\r\n\r\nMais dis-moi vraiment c’que tu ressens pour moi\r\nMais dis-moi franchement ce que tu attends de moi\r\nJ’ai besoin de savoir si nous sommes sur la même voie\r\nSi notre histoire a une chance de durer ou pas\r\nVoilà déjà des mois que tu t’éloignes de moi\r\nEt moi j’ai mal et tu ne le remarques pas\r\nOu sont passées toutes tes promesses qui me donnaient espoir\r\nTu vois je ne te reconnais plus, je t’en prie parle-moi\r\n\r\nPalé ba mwen dou di mwen, palé ba mwen\r\nPalé ba mwen\r\nPalé ba mwen dou di mwen, palé ba mwen\r\nPalé ba mwen dou di mwen, palé ba mwen\r\nDou palé ba mwen\r\nPalé ba mwen dou di mwen, palé ba mwen\r\nDis-moi\r\n\r\nVoilà déjà des mois que tu t’éloignes de moi\r\nEt moi j’ai mal et tu ne le remarques pas\r\nOu sont passées toutes tes promesses qui me donnaient espoir\r\nTu vois je ne te reconnais plus, je t’en prie parle-moi\r\nOh ohoh\r\nParle-moi\r\n\r\nPalé ba mwen dou di mwen, palé ba mwen\r\nDi mwen tou sa ka pasé\r\nPalé ba mwen dou di mwen, palé ba mwen\r\nDou palé ba mwen\r\nPalé ba mwen dou di mwen, palé ba mwen\r\nPalé ba mwen dou di mwen, palé ba mwen\r\n\r\nJe t’en prie, dis-moi\r\n\r\nSi tu pouvais entendre ces mots, j’ai tellement mal je te dis\r\nJe te dis\r\nEt guérir mes mots j’ai tellement mal je te dis\r\nJe te dis\r\nEt si je savais comment m’y prendre pour t’empêcher de partir\r\nTout s’rait différent\r\nJe n’aurais plus mal je t’assure\r\nSi je pouvais trouver les mots pour t’empêcher de partir\r\nSi je pouvais\r\nSi je pouvais trouver les mots qu’il faut\r\nSi je savais trouver ces mots qui sauront te retenir\r\nSi je savais\r\nSi je savais trouver les mots\r\n\r\nSi tu pouvais entendre ces mots, j’ai tellement mal je te dis\r\nJe te dis\r\nEt guérir mes mots j’ai tellement mal je te dis\r\nJe te dis\r\nEt si je savais comment m’y prendre pour t’empêcher de partir\r\nTout s’rait différent\r\nJe n’aurais plus mal je t’assure\r\nSi je pouvais trouver les mots pour t’empêcher de partir\r\nSi je pouvais Te retenir encore un peu\r\nSi je pouvais trouver les mots qu’il faut\r\nSi je savais trouver ces mots qui sauront te retenir\r\nSi je savais Te retenir encore, encore\r\nSi je savais trouver les mots\r\n\r\nPalé ba mwen dou di mwen, palé ba mwen\r\nPalé ba mwen\r\nPalé ba mwen dou di mwen, palé ba mwen\r\nPalé ba mwen dou di mwen, palé ba mwen\r\nDi mwen tou sa ka pasé\r\nPalé ba mwen dou di mwen, palé ba mwen\r\nDi mwen tou sa ka pasé\r\nPalé ba mwen dou di mwen, palé ba mwen\r\nPalé ba mwen dou di mwen, palé ba mwen\r\nDi mwen tou saw ka pensé\r\n\r\n--\r\nYourZoukTv est la chaîne YouTube entièrement dédiée à toute la musique Caribéenne ! \r\nZouk, Dancehall, Traditions, Nouvelle scène créole, mais aussi contes, concerts, lives, Interviews ! \r\nRetrouvez tout l''esprit de la Caraïbe en quelques clics !\r\nAbonnez-vous : http://bit.ly/1gq5g8Z\r\nSITE - http://www.believedigitalstudios.com/\r\nFACEBOOK - https://www.facebook.com/YourZoukTv\r\nTWITTER - https://twitter.com/YourZoukTv', NULL, NULL, 0, NULL),
