(2507, 'Banton', 'yiapZkSgLKE', '2016-06-05 17:02:00', 1, 'banton', 'Your Zouk TV', '"BANTON"\r\nécrit et composé par: KARL-J, IMANI, Steve PIERRE-LOUIS\r\nclip réalisé par IMANIBASE\r\ncontact:\r\nenterpiesgroup@gmail.com/\r\n+33671851873\r\n\r\nKARL-J, de son vrai nom Johan Karl Jomie, est un artiste de reggae-dancehall français. Inspiré par Admiral T, Buju Banton , Shabba Ranks ou encore Vybz Kartel.\r\nOriginaire du Gosier en Guadeloupe, il fait tout d''abord ses premières armes dans le rap mais se tournera très vite vers le ragga. Il débute à 16 ans dans les petits sounds systems de lycées et de quartiers avant de faire la rencontre d’IMANI qui lui permettra d''exploiter toutes les facettes de son talent.\r\nil signe chez Enterpies Music et sort le 02 mai 2016 sa première Mixtape, Composer de 11 titres Explosifs. Entre dance hall, trap, zouk et RnB,son style donne envie de danser avec des morceaux dynamiques.\r\nKarl J c''est le phénomène antillais a venir. Une voix grave, un flow rapide et des refrains mélodieux. Le chanteur fait un carton avec son titre « Banton» .\r\n\r\n--\r\nYourZoukTv est la chaîne YouTube entièrement dédiée à toute la musique Caribéenne ! \r\nZouk, Dancehall, Traditions, Nouvelle scène créole, mais aussi contes, concerts, lives, Interviews ! \r\nRetrouvez tout l''esprit de la Caraïbe en quelques clics !\r\nAbonnez-vous : http://bit.ly/1gq5g8Z\r\nSITE - http://www.believedigitalstudios.com/\r\nFACEBOOK - https://www.facebook.com/YourZoukTv\r\nTWITTER - https://twitter.com/YourZoukTv', NULL, 'imanibase;', 0, NULL),
