(2587, 'Sex therapy', '4C4CK7p0-qI', '2016-07-03 15:55:00', 1, 'sex-therapy', 'Lycinais Jean', 'Découvrez le Nouveau Single de Lycinaïs Jean...\r\n\r\nTitre: Sex therapy (sorti le 24 juin)\r\nA/C: Lycinaïs Jean\r\nProduction/Arrangements: Lycinaïs Jean\r\nMix/Mastering: Cedric Berkeley (DreamTracks)\r\nRéalisation: Jima Kanor\r\nFiguration: Thia Brownsugar (FB & IG)\r\nCoiffure Locks: Lacoiff Xioune (FB & IG)\r\n\r\nRemerciements: TeamLycinaïsJean \r\n\r\n(Beaucoup d''histoires d''amour commencent sur un coup d''un soir, puis on fait du sexe une thérapie... finalement cette passion se transforme en un rêve... un rêve comme celui évoqué dans le clip "mwen enmé-w"... d''ailleurs voulez-vous savoir comment cette aventure a commencé?)\r\n\r\n..........................................................\r\nParoles:\r\n\r\nREFRAIN:\r\nsex therapy\r\ntrètman-la radikal\r\nslow ou bien rapide mais pas à la va vite\r\nba-y sex therapy\r\npaskè ba li sa vital\r\nout oubien in, out oubien in...\r\n\r\nSex in the rain\r\nina your room\r\nin our dreams and in our real life\r\nSex in the studio\r\nagainst the wall \r\nafter party, before sunrise\r\nsex to de-stress\r\nsex with a sex bomb\r\nsex with an ex\r\nor with your lover\r\nfor the umpteenth time\r\nor the first time\r\nyes we did it, yes we need it...\r\n\r\n(REFRAIN)\r\n\r\nKité mwen ba-w S-E-X\r\nmi ba-w an vini pou ba vou-i myé ki ex\r\nèvè tout an finès\r\nméné vou sè-ti-yèm syèl\r\nmiwa si plafon pou’w pa pèd pon ti myèt\r\né an tout politès an vé vwè-w an féblès\r\npèd kontwòl èvè rimé anba karès\r\nèvè si ou ka dakò an ké fè an ti test\r\njis pou lè pléziw vé gadé vou touché-w\r\nsi i bon pa toufé-y...\r\n\r\n(REFRAIN)\r\n\r\noh my baby\r\nje t’aurais fait tellement de choses\r\ndemande moi quoi si tu l’oses \r\nsi tu préfères  \r\nles belles surprises j’t’en proposerai…\r\nround après round, pause…!\r\nHow to breathe\r\nWhen you’re touching me there\r\nhow to keep quiet\r\nkiss me there\r\nlaisse moi faire\r\nmais surtout laisse toi faire\r\nHmmmm...\r\n\r\n(REFRAIN)\r\n\r\nGive it up...\r\nLet me give it up yeah\r\nGive it up...\r\nlet me give it up to you,\r\nGive it up...\r\nLet me give it up yeah\r\nGive it up hmm...\r\n\r\nMwen lé-w mwen lé-w... X2', NULL, NULL, 1, '2016-07-04 08:12:27'),
