(2621, 'Ou chanjé', 'P1KbBMqSXpI', '2016-07-12 07:35:00', 1, 'ou-chanje', 'Your Zouk TV', '█▬█ █ ▀█▀ ██▓▒░ ♫♫♫Retrouve Mickige dans une atmosphère à la fois sensuelle et mélancolique sur une rythmique dancehall  r’n’b.  «Ou Chanjé»  ou « Quand l’euphorie de l’amour laisse place à l’amertume de la trahison ». Le titre « Ou Chanjé »  dépeint une réalité pouvant concerner toute personne investit dans une relation sérieuse et qui ne reconnait sa moitié par rapport à ses actes et son comportement. \r\n\r\nAuteur :Mickige\r\nCompositeur :NikoOo\r\nMastering :PM Studio\r\nMixing :Twoface\r\nRéalisation :Lyris Haye \r\nLumière :Salomon Hernandez\r\nStoryboard :Sa Soti Yana\r\nManagement : sasotiyana@gmail.com\r\nFigurante :Malyssia\r\nMaquillage :Cherry Gaby & Natacha Miranda\r\nPartenariat :NICOLAS FEUILLATE/LE GRAND HOTEL MONTABO/LE MASQUE BLANC\r\n\r\nCouplet 1 :\r\n\r\nAn té compren an té konet vou\r\nMi a présen men ka dépalé\r\nPass dépi jou la ke an tchek vou\r\nAn té comprend nou té bien palé\r\nAn té crouè an té bien chansé\r\nAlè an ka pito crouè le contraire\r\nSa dommage pass èvèw an té vé vansé\r\nMé jodi assiré ke sa ké le contraire\r\nPass an découvè an lot facette di vou\r\nOu bien cé vou mem ki té la an cachette\r\nMé An pé ké fè pon kout machette si vou\r\nMem si projet nou ka pati an fimé kon cigarette \r\nPass ou fè mwen espéré\r\nKe men té pé ète éré\r\nAlé an desesperé\r\nMwen ou finn exaspéré\r\nCé bon an ka kité lanmou la pou lé zot\r\nPass an vi an mwen i ja fè twop dézod.....\r\n\r\n\r\nRefrain :\r\n\r\nOu chanjé\r\nAn pa ka rikonet vou enco\r\nOui bébé Ou chanjé\r\nOu pa té kon sa avan\r\nMè bébé ou chanjé\r\nNou péké ricoumencé enco\r\nPass bébé ou chanjé\r\nEt ou pa té kon sa avan\r\nAvan …....\r\n\r\n\r\nCouplet 2 :\r\n\r\nRespé mwen é konfyans mwen baw finn volé an éclat\r\nEt an certains kéy ni dot surprise a la prochaine étape\r\nAn ziè mwen ou ka passé de fucking best a fucking fesse\r\nDéplacé pren tout bitin aw an pa lé fucking reste\r\nOu joué èvè tout sentiment mwen\r\nAn péké dépensé ne serait ce qui on centime  an mwen\r\nBaw\r\nPass èvè le temps ou dévoilé vrè visage aw\r\nAussi vrè et faux ki fucking tissage aw\r\nAn vé ay loin de tout siyage aw\r\nBébé\r\nAn péké pléré baw kon an ti pédé\r\nAn ké sa remonté la pente é sa sans crié maydey\r\nMé an simen nou fout sa la\r\nChimin nou bout a la\r\nVase la débodé a goutte ta la \r\nPou mois d’Août ta la\r\nTiré doute ta la an tet mwen \r\nEt di mwen ki sa an fèw pou mérité kou ta la\r\nMé\r\nCé bon an ka kité lanmou la pou lé zot\r\nPass an vi an mwen i ja fè twop dézot....\r\n\r\n\r\n\r\nRefrain :\r\n\r\nOu chanjé\r\nAn pa ka rikonet vou enco\r\nOui bébé Ou chanjé\r\nOu pa té kon sa avan\r\nMè bébé ou chanjé\r\nNou péké ricoumencé enco\r\nPass bébé ou chanjé\r\nEt ou pa té kon sa avan\r\nAvan …....\r\n\r\n\r\nCouplet 3 :\r\n\r\nMeme si \r\nAn trompé ko mwen si sijé aw\r\nAlè la\r\nAn ka bien ouè clè adan jé aw\r\nOu fè kow passé pou sa ou pa yé\r\nAn vé pa tend palé diw enco fo taillé\r\nLoin loin loin de mwen\r\nFok ou taillé loin loin de mwen\r\nLoin loin loin\r\nLoin loin loin\r\nLoin Loin\r\nPass...\r\n\r\n\r\n\r\nRefrain X2 :\r\n\r\nOu chanjé\r\nAn pa ka rikonet vou enco\r\nOui bébé Ou chanjé\r\nOu pa té kon sa avan\r\nMè bébé ou chanjé\r\nNou péké ricoumencé enco\r\nPass bébé ou chanjé\r\nEt ou pa té kon sa avan\r\nAvan …....', NULL, NULL, 0, NULL),
