eur sûre, valeur sûre\r\n\r\nJacky et Ben-j le public a fait de nous\r\n\r\nUne valeur sûre, valeur\r\n\r\nOne love, one love (x4)\r\n\r\nCouplet :\r\n\r\nQuoi qu’il se passe,\r\n\r\nUnis et forts, à la vie, à la mort c’est ma famille d’abord\r\n\r\nMais quoi qu’il se passe même si il y a désaccord\r\n\r\nPeu importe qui a tort le soleil brille encore\r\n\r\nEh Oh ! j’ai le devoir d’éduquer mes enfants\r\n\r\nRespect papa, respect maman\r\n\r\nJe transmets mon savoir comme un flambeau\r\n\r\nUn regard vaut bien plus que des mots\r\n\r\nLe sourire d’un enfant n’est jamais faux\r\n\r\nOn s’aime avec nos charmes et nos défauts\r\n\r\nAvec les miens je me sens bien\r\n\r\nRefrain :\r\n\r\nOn a tous en nous quelque chose de précieux\r\n\r\nUne valeur sûre, valeur sûre\r\n\r\nA la recherche du bonheur, de ce qui nous rend heureux\r\n\r\nUne valeur sûre, valeur sûre\r\n\r\nOn se contente de peu mais on aspire à mieux\r\n\r\nUne valeur sûre, valeur sûre\r\n\r\nJacky et Ben-j le public a fait de nous\r\n\r\nUne valeur sûre, valeur\r\n\r\nOne love, one love (x4)\r\n\r\nPont :\r\n\r\nOn est parti de rien, Jacky et Ben-j ont fais les choses bien\r\n\r\nPour y arriver éeh éeh éeh\r\n\r\nSans jamais rien lâcher\r\n\r\nRefrain :\r\n\r\nOn a tous en nous quelque chose de précieux\r\n\r\nUne valeur sûre, valeur sûre\r\n\r\nA la recherche du bonheur, de ce qui nous rend heureux\r\n\r\nUne valeur sûre, valeur sûre\r\n\r\nOn se contente de peu mais on aspire à mieux\r\n\r\nUne valeur sûre, valeur sûre\r\n\r\nJacky et Ben-j le public a fait de nous\r\n\r\nUne valeur sûre, valeur\r\n\r\nOne love, one love (x4)', NULL, NULL, 0, NULL),
