(2672, 'La danse de la joie', 'KtJAAf-2R-o', '2016-07-25 07:55:00', 1, 'la-danse-de-la-joie', 'Your Zouk TV', 'Facebook : https://www.facebook.com/Micko-PhénoméneM-officiel-180651275319220/\r\nTwitter : https://twitter.com/MickophenomeneM\r\n- MICKO PHENOMENEM  vous présente son Single AFRO / CLUB / URBAIN : \r\n« LA DANSE DE LA JOIE » \r\nMICKO PHENOMENEM, de son vrai nom ROSENA Magnekel, a été bercé par la musique dès son plus jeune âge. Très tôt, il écoute des artistes tels que Buju Banton ou Admiral-T mais ses influences émaneront essentiellement de Jamaïque (Sean Paul, Major Lazer …) et d’Haïti, dont il est originaire.\r\nClassé numéro 5 sur Radio Latina, son single “PRETTY GIRL” a fait partie des Hits de l’année 2015. Il sera d’ailleurs invité sur de nombreuses compilations telles que : “Latina party 2015”, “80 Hits Latino”,  “Latino Star 2015” ou encore “100 Dance Summer 2015”.\r\nPlus qu’un simple interprète, MICKO PHENOMENEM impose un timbre de voix très personnel et des gimicks affirmant un style qui lui est propre.  \r\nMICKO PHENOMENEM, artiste très prometteur, vous fera danser tout l’été avec son nouveau single : « LA DANSE DE LA JOIE ».\r\n\r\n- Crédits video clip : \r\nRéalisateur : Cleefson\r\nAssistant réal : Louis Dalcé \r\nStyliste : Dieunor Masson \r\n\r\n- Merci aux danseuses :\r\n " Crushin''Gyal " et "Layone''s crew"', NULL, NULL, 0, NULL),
