(2693, 'On S''aime', 'TrlssyXUMSE', '2016-07-29 07:39:00', 1, 'on-s-aime', 'Your Zouk TV', 'RHAMSIN - ON S''AIME (CLIP OFFICIEL)\r\n\r\nContact: sasotiyana@gmail.com\r\n\r\nAuteur: Rhamsin\r\nCompositeurs:Twoface Supafly/Iknow\r\nMixing: Twoface Supafly\r\nMastering: PM Studio\r\nStoryboard/Co-réalisation: Sa Soti Yana\r\nFigurants: Jérémie/Joyce/Audry\r\nStylisme: Keur de Wax/Sarah boutique\r\nMaquilage: Cherry Gaby\r\nLumières: Salomon Hernandez\r\n\r\n\r\n\r\n\r\nRHAMSIN – ON S’AIME\r\n\r\nIntro\r\n\r\nRham to the sin again\r\nSa soti yana again\r\nHaffi mi gyal dem again\r\n\r\nCouplet 1\r\n\r\nQuand nos longues conversations ne suffisent plus à nous combler\r\nOn essaye de faire semblant mais on connaît la vérité\r\nNos regards ne sauraient mentir\r\nN’importe qui pourrait le ressentir\r\nOn refuse de se l’avouer mais c’est une évidence\r\nQuand à peine on vient de se quitter et qu’on veut déjà se retrouver\r\nQu’on sait qu’on peut se faire confiance nul besoin de se le prouver\r\nJuste se voir nous donne le sourire\r\nPourtant on a choisi de se mentir\r\nOn préfère se retenir par peur des conséquences\r\n\r\nRefrain\r\n\r\nEt on s’aime\r\nNous ne sommes que des amis\r\nMais on s’aime\r\nMême si c’est interdit\r\nOn s’aime\r\nDans toute cette comédie\r\nNos cœurs saignent\r\n\r\nCouplet 2\r\n\r\nSi seulement on s’était connu autrement\r\nSi seulement on pouvait retourner dans le temps\r\nOn n’en serait pas là maintenant\r\nOn n’aurait pas à masquer nos sentiments\r\nMalheureusement les choses se passent autrement\r\nEt impossible pour nous de réécrire ce roman\r\nNous sommes arrivés là je ne sais pas comment\r\nJuste obligés d’assumer le châtiment\r\nOn a décidé\r\nDe vivre notre amour en silence\r\nPas besoin de se parler\r\nJuste en se regardant on sait tout ce qu’on pense\r\nOn préfère éviter de se rapprocher par respect pour nos proches\r\nChaque fois qu’on se croise on se fait violence\r\nMais nos cœurs ne sont pas des roches\r\n\r\nRefrain', NULL, NULL, 0, NULL),
