(2701, 'Le seul', 'f9Uf6VGgt_k', '2016-08-01 07:54:00', 1, 'le-seul', 'Ideal Songs Tv', 'EDWINE LAGIER - Le Seul / ZOUK 2016\r\n\r\n\r\nUne production Rick Drey Music / Jean-Marc Templet\r\n\r\nRéalisation clip : Unity Films Productions / Luméos Productions\r\n\r\n\r\nAuteur : Patrick Andrey / Edwine Lagier\r\n\r\nCompositeur : Patrick Andrey\r\n\r\nArrangements : Patrick Andrey\r\n\r\nBasse  : Mike Clinton\r\n\r\nGuitare : Alexandre Cabit\r\n\r\nPrise de son voix : Rhino\r\n\r\n\r\nMixed By Drey\r\n\r\nMastering  :Housddjo Prod.\r\n\r\nDesign Cover : Blombix\r\n\r\nEditions : Idéal Songs Music\r\n\r\n\r\nJe tiens à remercier toutes les personnes qui ont participé à la réalisation de mon clip. \r\n\r\nUn grand merci à Patrick Andrey pour cette merveilleuse composition.\r\n\r\nMerci à Davy Williams Fanchonnette pour sa participation dans le clip.\r\n\r\nUn remerciement particulier à Rodi Rbr, Jean-Marc Templet et Michel Linérol qui ont cru en moi.\r\n\r\nMerci à ma source d''inspiration...\r\n\r\nMerci à N''rick pour son aide très précieuse, à Elodie Lagier (ma soeur) pour sa présence et son aide durant le tournage.\r\n\r\nEt je tiens à remercier tous les médias qui me soutiendront.\r\n\r\nJe fais un gros bisous à ma Famille, mes amis et aussi à Lamu et Jeff de Rbr.\r\n\r\nUn remerciement spécial a Jessye Belleval.\r\n\r\n\r\n\r\n                                    LE SEUL   \r\n\r\nComment trouver l''âme soeur pour ne plus avoir peur\r\n\r\n\r\nLes promesses des hommes, on connait par coeur\r\n\r\n choeurs : Trouver l''âme soeur...celle qui partage mes joies \r\n\r\n                  Trouver le seul         ... pour effacer mes peines\r\n\r\n                  Trouver l''âme soeur ...celle qui fera de moi sa reine wohoooo\r\n\r\nJ''ai passé trop de temps, seule à espérer            \r\n\r\nj''ai passé bien des nuits à désesperer    \r\n\r\nJe ne suis pas de celle qui va te supplier\r\n\r\nMais je veux t''avouer,\r\n\r\nTu es le seul à avoir la clé de mon coeur\r\n\r\nTu es le seul  à avoir la clef de mon coeur  \r\n\r\nTu es le seul, celui, qui fera de moi ton âme soeur\r\n\r\nTu es le seul, celui, qui me connaitra par coeur\r\n\r\n(Tu es le seul, le seul qui me guérira des autres)\r\n\r\nTu es le seul, le seul, celui qui peut me rendre forte\r\n\r\nJe lance une bouteille à la mer\r\n\r\nEn espérant qu''elle te parvienne oooh\r\n\r\nun S.O.S, un message\r\n\r\nJe lance un appel de détresse\r\n\r\nEn espérant que tu le vois oooh \r\n\r\nun S.O.S, un message   \r\n\r\nTu es le seul, à avoir la clef de mon coeur\r\n\r\nTu es le seul, à avoir la clef de mon coeur\r\n\r\n choeurs : la clef, la clef (etc)\r\n\r\n                oui je te la donne, prend la, elle t''aidera\r\n\r\n                oui je te la donne pour que tu ouvres mon coeur\r\n\r\n                oui je te la donne, prends la, elle t''aidera \r\n\r\n                oui je te la donne pour que tu ouvres mon coeur, \r\n\r\n                Pour que tu puisses ouvrir mon coeur...  na na na na na...', NULL, NULL, 0, NULL),
