(2717, 'On jou ki tan nou', 'b3HQQCwIPWA', '2016-08-04 07:47:00', 1, 'on-jou-ki-tan-nou', 'Your Zouk TV', 'https://itunes.apple.com/fr/album/on-...\r\nWakanza Are: Kaïlyn Ryse Aka Caroline LOIAL , Mïkytone Aka Mike Clinton et Sir-G Aka Gregory LOUIS.\r\n\r\nComposed By Caroline LOIAL / Mike CLINTON / Gregory LOUIS / Kevin JUBERT\r\nLyrics By Caroline Loial / Mike CLINTON / Gregory LOUIS\r\n\r\nDirected By: WAKANZA\r\nLead and Backing Vocal: Caroline LOIAL\r\nSequenced by: Gregory LOUIS\r\nKeyboards: Kevin JUBERT\r\nBass: Mike CLINTON\r\nGuitar: Amen VIANA\r\nDrums, Percussions: Gregory LOUIS\r\nTambou St Jean/ Chacha: Dominique TAULIAUT, Laurent SUCCAB, Robert COLINE\r\nEngineer, Mixed By Cyrille TRACLET and Gregory LOUIS\r\nRecording Studio: Cybersound Studio Paris\r\n\r\nClip Version Officiel Version Courte\r\nRendez-Vous très bientôt pour la version Longue....A Suivre.....\r\n\r\n\r\nSingle "ON JOU KI TAN NOU" disponible sur toutes les plateformes de téléchargement légales: https://itunes.apple.com/fr/album/on-...\r\n\r\nTRADUCTION FR: "AUJOURD''HUI, C''EST NOTRE JOUR"\r\n\r\nComment vas-tu mon frère? Et toi ma soeur?\r\nUn jour nouveau est arrivé pour nous aujourd’hui\r\nNous n’avons besoin de rien, surtout pas de mauvaises ondes\r\nTout ce que nous voulons ce sont des lendemains meilleurs\r\n\r\nPré-refrain:\r\nViens avec nous, semer plus d’amour\r\nApaiser ceux qui souffrent\r\nArrête de te plaindre, décides-toi\r\nDonne de bonnes vibes à ceux qui en ont besoin\r\nEclaire le chemin de ceux qui sont perdus\r\nDans l’obscurité\r\nEt si tu es prêt, lève-toi et chante\r\nEnsemble on sera mieux / L’union fait la force\r\n\r\nREF:\r\nAujourd’hui c’est notre jour (n’en doute pas)\r\nToi et moi nous irons loin\r\nSeuls l’amitié et l’amour\r\nNous aiderons à aller plus loin\r\n\r\nOh oui, rien ne pourra nous séparer\r\n\r\nChoeurs 2:\r\nViens avec moi, Donne-moi la main\r\nViens avec moi, ne me laisse pas\r\nViens avec moi, il faut que tu me donnes la main\r\nViens avec moi, pour que l’on aille plus loin\r\n\r\nComment ça va maman, et toi papa\r\nQuel bel espoir vous nous donnez aujourd’hui\r\nPour nos enfants, pour nos amis autour de nous\r\nTout ce que nous voulons c’est leur apporter un peu de chaleur\r\n\r\nPré-refrain:\r\nViens avec nous, semer plus d’amour\r\nApaiser ceux qui souffrent\r\nArrêtes de te plaindre, décides-toi\r\nA donner de bonnes vibes à ceux qui le demandent\r\nDis à l’enfant de venir, Dis à mamie de venir\r\nPour donner de la force au pays\r\nEt si tu es prêts aides-moi à chanter\r\nEnsemble ce sera mieux\r\n\r\nCoda:\r\nOuai, est-ce que vous êtes prêts? Ouai\r\nOui nous sommes venu pour chanter\r\nDebout, debout, debout\r\nÉlevons nos voix\r\n\r\n\r\nENG TRADUCTION : TODAY IS OUR DAY (Audio)\r\n\r\nHow are you my brother? And you my sister?\r\nA new day has come for us today\r\nWe do not need anything, especially no bad vibes\r\nAll we want is a better tomorrow\r\n\r\nPre-chorus 1:\r\nCome with us, sowing more love\r\nSoothe those suffering\r\nStop complaining, decide yourself\r\nGive good vibes to those who need it\r\nEnlighten the path of those who are lost\r\nIn darkness\r\nAnd if you''re ready, get up and sing\r\nTogether we will be better / Unity is strength\r\n\r\nChorus:\r\nToday is our day (do not doubt)\r\nYou and I will go far away\r\nOnly friendship and love\r\nwill help us to go further\r\nOh yes, nothing will separate us\r\n \r\nHook 1:\r\nCome with me, Give me your hand\r\nCome with me, do not leave me\r\nCome with me, you must give me the hand\r\nCome with me, so that we go further\r\n\r\nHow are you mom? And you Dad?\r\nWhat a beautiful hope you give us today\r\nFor our children, for our friends around us\r\nAll we want is to bring them a little warmth\r\n\r\nPre-Chorus 2:\r\nCome with us, sowing more love\r\nSoothe those suffering\r\nStop complaining, decide yourself\r\nGive good vibes to those who need it\r\nTell the child to come, tell grandma to come\r\nTo give strength to the country\r\nAnd if you’re ready, help me sing\r\nTogether it will be better\r\n\r\nCoda:\r\nYeah, are you ready? Yeah\r\nYes we came to sing\r\nStand up! Stand up! Stand up!\r\nLet''s raise our voices', NULL, NULL, 0, NULL),
