(2836, 'Tou sa ou lé', '9e-79qGnqsw', '2016-09-01 19:56:00', 1, 'tou-sa-ou-le-1', 'Your Zouk TV', 'Le nouveau HIT de Jean-Marie Ragald issu de son Best Of!\r\n\r\nLien iTunes : https://itunes.apple.com/fr/album/best-of-2000-2015-only-you/id1016049931\r\n\r\nJEAN-MARIE RAGALD "Tou sa ou lé"\r\na/Jean Marie RAGALD c/Jim Rama\r\nProd Chabine Prod\r\nEditions De Nada Publishing\r\n\r\nRéalisation Radix Corporation\r\nMaquillage : Noémie Certain & Stéphanie Montlouis-Calixte\r\n\r\nMerci à Gauthier et Philippe de la Villa des Caps\r\nMerci à Malik & Stacy, les figurants\r\nMerci à la famille MURAT pour la Villa MURAT\r\n\r\n\r\nTOU SA OU LE\r\n\r\nViv a dé, fow ni kouraj « é é é o »\r\nOui nou tout sav sa pa fasil  « é é é o »\r\nE byen dé fwa tchèw ka blésé « é é é o »\r\nNon pa lagué fow sa tchimbé « é é é o »\r\nOb baby\r\n\r\nMwen baw tou sa ou lé « darling »\r\nE mwen toujou espéré « darling »\r\nMwen baw tou sa ou lé « doudou darling darling darling»\r\nMwen baw tou sa ou lé « darling »\r\nDi mwen ki sa ou ka mantché « darling »\r\nMwen baw tou sa ou lé « doudou darling darling darling»\r\n\r\nOh chérie\r\n\r\nWowowowo ééé\r\n\r\nNon, ou pa janmenn ni asé\r\nTou sa mwen fè ka fosséw\r\nSa mwen di ka déranjéw\r\n« Chérie mwen lé, mwen lé nou kontinué »\r\nNon, ou pa janmenn ni asé\r\nTou sa mwen fè ka fosséw\r\nSa mwen di ka déranjéw\r\nKi sa ou lé, ki sa ou lé pou sa chanjé\r\n\r\nMwen baw tou sa ou lé « darling »\r\nE mwen toujou espéré « darling »\r\nMwen baw tou sa ou lé « doudou darling darling darling» \r\nMwen toujou baw tou sa ou lé\r\nMwen baw tou sa ou lé « darling »\r\nDi mwen ki sa ou ka mantché « darling »\r\nMwen baw tou sa ou lé « doudou darling darling darling»\r\nChérie\r\nSi ou lé nou ké fè an ti dansé lanmou\r\n« pou nou lové an moman, pou nou tripé otreman »\r\nSi ou lé nou ké fè dé ti pa entre nou\r\n« pou nou lové an moman, pou nou tripé otreman »\r\n\r\nJe t’ai toujours aimé « mon cœur »\r\nJe pense t’avoir donné « oui mon cœur »\r\nMon cœur pour toujours\r\nJe veux te garder «  te garder »\r\nTe protéger « mon cœur »\r\nNe m’oublie pas mon amour « oui mon cœur »\r\nOn s’est donné rendez-vous\r\n\r\nBaby, baby, baby\r\n« carésé mwen »\r\nBaby, baby, baby\r\n« séré mwen fo »\r\nBaby, baby, baby\r\n« chalviré mwen »\r\nOoooo\r\n« sé pou sa mwen léw fo »\r\n\r\nMwen baw tou sa ou lé « darling »\r\nE mwen toujou espéré « darling »\r\nMwen baw tou sa ou lé « doudou darling darling darling»\r\nMwen baw tou sa ou lé « darling »\r\nDi mwen ki sa ou ka mantché « darling »\r\nMwen baw tou sa ou lé « doudou darling darling darling»\r\n\r\n\r\nMwen baw tou sa ou lé « darling »\r\nE mwen toujou espéré « darling »\r\nMwen baw tou sa ou lé « doudou darling darling darling»\r\nMwen baw tou sa ou lé « darling »\r\nDi mwen ki sa ou ka mantché « darling »\r\nMwen baw tou sa ou lé « doudou darling darling darling»\r\n\r\nOh chérie\r\n\r\nMwen baw tou sa ou lé « darling »\r\nE mwen toujou espéré « darling »\r\nMwen baw tou sa ou lé « doudou darling darling darling»\r\nMwen baw tou sa ou lé « darling »\r\nDi mwen ki sa ou ka mantché « darling »\r\nMwen baw tou sa ou lé « doudou darling darling darling»\r\n\r\n--\r\nYourZoukTv est la chaîne YouTube entièrement dédiée à toute la musique Caribéenne ! \r\nZouk, Dancehall, Traditions, Nouvelle scène créole, mais aussi contes, concerts, lives, Interviews ! \r\nRetrouvez tout l''esprit de la Caraïbe en quelques clics !\r\nAbonnez-vous : http://bit.ly/1gq5g8Z\r\nSITE - http://www.believedigitalstudios.com/\r\nFACEBOOK - https://www.facebook.com/YourZoukTv\r\nTWITTER - https://twitter.com/YourZoukTv', NULL, NULL, 1, '2016-09-06 23:54:41'),
