(2881, 'Sirèn', 'OoWn--ZRTyo', '2016-10-03 22:28:00', 1, 'siren', 'JUTSU MEDIA GROUP', 'Telecharger sur iTunes : https://itunes.apple.com/us/album/siren-feat.-keros-n-single/id1158861341\r\n\r\nA/Lycinaïs Jean & Keros-n\r\nR/G-islands\r\nC/Lycinaïs Jean\r\n\r\nSIRÈN (Lyrics)\r\nLycinaïs:\r\nkonfyan Alèkilé \r\nDouvan''w fanm paa rèkilé\r\nAn 50aine de maîtresses\r\nAgenda an détresse\r\nOu ka fè tiboug anvyéw\r\nKa pousé yo a défyé''w\r\nOu ni flow lò aw ka briyé\r\nAn enmé lawtis pé pa niyé\r\nMèw ka gadé mwen an dé zyé...\r\nKonsiw té ké fè mwen dévyé...\r\nYo té di ou vé akséléré mwen\r\nT''es mignon mais Fréné balan aw dépozé mwen...\r\nMe niquer me niquer tu n''as qu''ça à l''idée \r\nMais j''t''avoue qu''les russi-gyal sont plus proches de mon lir''dé\r\nSé vwé ou fè mwen réfléchi\r\nMè douvan fanm an afébli\r\nPé ké fè sanblan jémi\r\npou-w konprann ou s''on génie\r\nOu ka plè\r\nMè tout Jan an gadéw\r\nOdèla dè chawm é dousè\r\nFanm toujou ni le sekrè\r\nké toujou rann mwen deng\r\nban lafyèv kon ladeng\r\nL''an vwè yo an malad\r\nAn konplètman malad\r\nRefrain: X2\r\nSé vwé kè nou ni menm gou pou sirèn\r\nsèten sé pou sa''w pri si mwen dèpi konbyen simèn\r\nÈvè an ka avwé an pa si men\r\nOu pé santi bon sapé kon rwa an plito si rèn\r\nKeros-N:\r\nDonc chérie,\r\npalapenn palé two fò, palapenn pozé-w kèstyon\r\nan ké kontinyé palpé-w dousman\r\nou ka trouvé sa pa nowmal é poutan ou ka pétiyé andidan oui\r\nRussiman an puissan\r\nèvè pa méléw pou lé praktis, moun aw ni malis\r\nou sav an sé on gyaliss, téorèm la pa faktis\r\nworking girl ou aktris, pou gyal an ni bac + 15\r\nmè la fo an avoué Lycinaaaïs Kèw démarkéw\r\nzyé aw ka briyé plis ki lò an mwen an rèmarké\r\nsiw enmé russigyal talè an ni dé ka débarké\r\nannatandan an ké kontinyé trakéw kon détraké\r\nRefrainX2\r\nLycinaïs:\r\nPa pran-y mal merci mè non merci\r\nOu ké toujou touvé yonn i ké a la merci\r\nEn terme de jeux j''suis pas échec mais plutôt dames\r\nAn tan kè gyaliss ou pé konprann an adikt a sé médam!\r\nKeros-N:\r\nTchip! an ka jis konprann kè ou ké touné ou ké viré an ké pété bal\r\né kwè mwen an ké trapé one-shot pa yenki lyrical kwè mwen\r\nan ka toumé an ka toumé an sé on mal\r\npat a Hyenne an mwen ké fèw oublié russi-gyal\r\nRefrainX4\r\nAn vé an queen meeen, an di-w an pa asi « men »\r\nan vé an queen meeen… an vé an queen meeen…', NULL, NULL, 1, '2016-10-10 23:53:05'),
