(2952, 'Game Over', 'kGUTFapXi8c', '2016-10-30 17:36:00', 1, 'game-over-3', 'Admiral T Officiel', 'Game Over le 2ème single extrait du prochain album d''Admiral T qui sortira le 15 Avril 2017 lors de son concert évènement à l''AccorHotels Arena.\r\nAprès le succès de sa première collaboration avec Djanah sur le titre " Pa Gadé " comptabilisant plus de 2millions de vues sur Youtube , Admiral T réitère l''invitation sur le single GAME OVER et l''alchimie s''opère une fois de plus !\r\n\r\nTélécharge le single ici : https://itunes.apple.com/fr/album/game-over-feat.-djanah-single/id1169985697\r\n\r\nGAME OVER \r\n\r\nAdmiral T\r\nJ''suis désolé si je t''ai fait du mal\r\nMais saches bébé qu''il n''y a qu''une seule femme \r\nQue j''aime au plus profond de mon âme \r\n\r\nDjanah \r\nÇa fait des années qu''il n''y a plus cette flamme \r\nQuand je t''ai rencontré tu me disais \r\nQue tu m''aimais tous les soirs \r\nMais maintenant on s''ignore\r\nOn vit comme des étrangers \r\nJ''ai eu tort de penser que t''allais changer \r\nBébé, je m''en vais car j''en ai marre \r\n\r\nAdmiral T\r\nJe t''ai fait souffrir, j''suis d''accord \r\nMais tu ne vois pas mes efforts \r\nCar t''écoutes tes amies\r\nTe bases sur les "on-dit" \r\nJ''me souviens qu''avant on était plus forts \r\n\r\nDjanah \r\nJ''en ai plus qu''assez, j''en ai ras-le-bol \r\nDe tes beaux discours, des belles paroles \r\nTu me dis que j''suis jolie \r\nQue quand t''as envie de hum hum\r\nJ''te connais par cœur \r\n\r\nREFRAIN/\r\n\r\nAdmiral \r\nTu ne trouveras jamais baby\r\nUn autre gars comme moi \r\nDjanah \r\nTu ne trouveras jamais baby\r\nUne autre femme comme moi \r\n\r\nCOUPLET 2/\r\n\r\nDjanah \r\nT''es pire qu''une meuf quand tu te fais beau\r\nSur les réseaux t''exhibes tes abdos\r\nTu crois que je ne vois pas ton ptit jeu\r\nTu te prends pour 2Pac \r\nToi et tes potes, vous jouez aux durs\r\nMais vous pleurez quand on vous plaque \r\n\r\nAdmiral T\r\nTu vois, j''te parle tranquille\r\nToi tu me parles mal\r\nT''es toujours hostile \r\nPartout tu vois le mal\r\nJ''te dis rien quand tu sors avec tes copines à deux balles \r\nFemmes sexy sans cervelle à la recherche de mâles \r\n\r\nDjanah\r\nEn tout cas tu n''arrives pas à la cheville du gars de Monica \r\nJ''me demande ce que je fais avec toi\r\n\r\nAdmiral T\r\nMonica, celle qui a fait le bébé juste pour garder son mec \r\nMalgré tout il l''a larguée comme une vieille chaussette \r\nD''ailleurs depuis que tu la fréquentes\r\nTu me parles de refaire ton ventre \r\nJ''parie que c''est elle qui te remplit la tête\r\n\r\nDjanah \r\nBaby, mais qu''est-ce que tu racontes\r\nT''as rien compris du tout \r\nC''est pour toi que j''essayais d''être belle \r\nJ''ai bien vu que tu ne me regardes plus comme avant \r\nÇa me fait mal mais je me suis faite une raison \r\nSi je n''ai plus le corps de mes vingt ans\r\nC''est parce que j''suis maman\r\nEt que je t''ai donné le plus beau des enfants \r\n\r\nREFRAIN/\r\n\r\nCOUPLET 3/\r\n\r\nAdmiral T\r\nRanguidangdangdè ranguidangdangdè \r\nAu moindre petit problème \r\nTu veux me larguer \r\nSi tu veux partir je ne te retiens pas\r\nSaches que par contre si tu pars\r\nPars, mais ne reviens pas \r\n\r\nDjanah \r\nRanguidangdangdè ranguidangdangdè \r\nJ''ai tout essayé mais là je déclare forfait\r\nT''es trop égoïste, tu ne penses qu''à toi\r\nTu ne mérites pas, une femme comme moi\r\n\r\nAdmiral\r\nJ''aurais pu donner ma vie pour toi, moi\r\nEt t''oses dire, que je ne pense qu''à moi\r\n\r\nDjanah \r\nTu parles de moi ou de celle\r\nQui t''avait appelé sur ton phone tèl \r\nT''inquiètes je n''oublie pas \r\n\r\nREFRAIN/\r\n\r\nCOUPLET 4/\r\n\r\nDjanah \r\nÇa fait des années qu''il n''y a plus cette flamme \r\nQuand je t''ai rencontré tu me disais \r\nQue tu m''aimais tous les soirs \r\nMais maintenant on s''ignore, on vit comme des étrangers \r\nJ''ai eu tort de penser que t''allais changer \r\nBébé, je m''en vais car j''en ai marre \r\n\r\nAdmiral/Djanah \r\nLeave me alone baby\r\nLeave me alone\r\nVaut mieux qu''on se sépare \r\nÇa ne sert à rien de continuer \r\nLeave me alone \r\nLeave me alone Baby\r\nOn se fait du mal et ça ne fait qu''empirer Donc leave me alone', NULL, NULL, 1, '2016-11-05 15:56:01'),
