(2976, 'Amour interdit', '0DR7wVqpwcs', '2016-11-11 13:21:00', 1, 'amour-interdit', 'Guy Event', 'Réalisation : (Guy Event)\r\nPWINCESS CLEAR " AMOUR INTERDIT " \r\n\r\nContact : \r\nTwitter : https://twitter.com/guyevent_twitte\r\nFacebook : https://facebook.com/Guy.Event/\r\n\r\nAbonnez-vous à notre Chaine pour suivre toute nos actualités.\r\n\r\nRemerciement : Beauty style accessoires, Le maestro, Rêves Gwada, Color locks.\r\n\r\nhELLO tout le monde,\r\n\r\ncomment faire court, car je sais vous aller direct regarder le clip sans me lire haha,,mais je dois vous donner la description du clip représenter en suspense ...\r\n\r\n''''une jeune fille de 15 ans au début expliquant a sa mère son amour , mais la trouvant trop jeune elle lui interdisait énormément de chose surtout ce dont elle aimait le plus des son jeune age,\r\npuis a 25 ans cette même jeune femme s''imposa et explique a sa mère qu''elle l''aime oui mais qu''elle devrait être moins stricte concernant Dieu , qu''elle devrait écouter son cœur de maman et laisser sa fille vivre sa vie comme elle le souhaite'' que seul Dieu a le dernier mot.\r\nbien évidement cette jeune fille parle de sa PASSION POUR LA MUSIQUE oui oui son amour interdit représenté est bien un amour '''' de projet'''' , car il paraît que Dieu n''y prendrait aucun plaisir que se sont les choses du monde, sans oublier ses tatouages, ses vetements, sa façon de s''amuser en gros...cette jeune femme montre a sa mere qu''elle fait rien de mal''''\r\n\r\n j''ai voulu faire passer un message a mes proches pour leurs montrer que je suis moi et je le resterais avec mes propres experiences car j''en devient heureuse et surtout ai-je pour autant abandonné Dieu non!\r\n\r\namour interdit c''est aussi tout type d''amour le physique a pas été représenter pour bien insisté sur le fait qu''il y a plusieurs type d''amour que c''est hyper vaste pas besoin de clip pour le représenter vraiment c,''est selon votre coeur, votre vie votre vecu votre ressenti sur ce que vous savez de moi sur tel et tel choses....\r\n\r\nTous que je peu rajouter sur lamour interdit physique.... Le racisme la différence d''age de religion l''homosexualité de classe social de corpulence de tout ce qui fait vous ressenter de l''amour il serait temps laisser les gens s''aimer a leurs manieres vous ne cautionner pas certaines choses pour le '''' qu''en dira ton'''' mais laisser ces gens vivre vous n''etes pas Dieu....\r\n\r\nSi ta ton projet ton reve et malgré tu ressens l''interdit des paroles par ci par la fonce....vis le car demain tu le regretteras.\r\n\r\n bien que je parle de ma vie passion pour le suspense j''assume vos traductions car moi j''aime l''amour'' j''aime l''interdit j''aime \r\n\r\nEcouter surtout les paroles et traduisez le selon votre amour interdit a vous cacher au plus profond vous\r\n\r\nsi cela vous plait partager en masse .....avec ce texte', NULL, NULL, 0, NULL),
