(106, 'Jim rama', 'Né à Pointe à Pitre un 8 avril. Il est aujourd’hui une référence de la musique zouk dans divers coins du globe (Antilles, La Réunion, Guyane, Nouvelle-Calédonie, Afrique, Europe, Haïti, Cap Vert, Amérique du Nord...). Le chanteur a démarré sa carrière avec le groupe Kanel en région parisienne. Son talent dans le domaine de la programmation et des arrangements lui vaut de travailler rapidement avec des pointures comme Guy Bordey et Slaï. Il est également auteur de nombreuses compositions à succès. Son parcours méritant l''a tout naturellement conduit à sortir un premier projet , Nuits Intimes en 1998, avec le tube Ou pati , intensément zouk love. En 2001 , il sort un deuxième concept Lov Intans, avec Maléré , encore une chanson sur-diffusée en boîte de nuit. En parallèle, le chanteur connaît le succès avec le duo Face-à-Face qu’il forme avec Patrick Andrey et sort l’album Face à Face volume 1. En 2002 , c’est au tour de Face à Face volume 2 .\r\nPuis En 2004, retour avec un album solo , As de Coeur qui sera sûrement celui qui marque le plus la carrière de Jim , grâce à la chanson Sandy , que le public n’hésite pas à scander à tue-tête à chaque apparition scénique de l’artiste. 2005, le concept Face-à-Face présente son volume 3. En 2006, nouvel album solo intitulé Charmes, qui arrive dans les bacs avec le titre Touloulou, un clin d’oeil à la Guyane. En 2008, Face à Face déjà bien présent dans le coeur de ses fans aux Etats-Unis et en Haïti, décide de travailler avec Nickenson Prudhomme afin d''apporter une touche « Kompa Love » à son 4ème opus . De cette alliance est né le tube Pani pli bel . Sur le même album, on peut aussi trouver le fameux « Ghetto Face à Face » , qui assoit le duo dans la sphère des groupes de zouk à succès.\r\n\r\nAprès 10 ans de carrière, Face à Face sort son premier collector : les meilleurs titres sont regroupés sur un même album.\r\n\r\nJim Rama et son compère Patrick Andrey sillonnent le monde et font découvrir leur culture zouk dans les plus grands festivals tels que Il Baïa au Cap Vert, où ils se produisent devant plus de 700 000 spectateurs.\r\n\r\nAprès une longue tournée, Jim décide de sortir son 4ème album solo Cupidon avec des invités de taille tels que Alan Cavé, Isidora du Cap vert et Anoféla de la Côte d''Ivoire (Ce dernier en feat. sur le tube « Yes patron »)\r\nFace à face est de retour en 2013 avec l’album 5 étoiles et le titre Toute la night en feat Missié GG.\r\n\r\nLe premier best of de Jim Rama intitulé Update sortira en 2014 avec le tube Su-\r\ncré Salé... Le 18 décembre 2015, désormais en solo, le chanteur sort son 5e album As de Pique dont Le tour du monde est le 4e extrait . Album qui en neuf mois es déjà bien plébiscité un peu partout dans le monde , où le zouk est prisé...', '2013-09-02 19:49:00', 'jim-rama', '200862339962158', 'JimRamaZouk', 'jimrama'),
