(244, 'Damien Marley', 'Damian marley aka Junior Gong est le fils du bien célèbre Bob marley, c''est aussi un artiste jamaïcain qui perce dans le reggae.', '2013-12-05 21:28:00', 'damien-marley', 'damianmarley', 'damianmarley', ''),
(245, 'B-jay', 'B-jay, de son vrai nom Jérémie battery, est originaire de la Martinique et de la Guyane.\r\n\r\nSa passion précoce pour la musique l''amène à composer ces premières notes dès l''âge de 5 ans.\r\n\r\nIl débute très rapidement sa carrière professionnelle. Agé de seulement 14 ans, B-Jay intègre la « Battery Family », groupe de gospel formé par sa famille.\r\n\r\nIl enchainera avec, plus de 200 concerts à travers toute la France dont une prestation remarquée sur M6 dans l''émission « Hit Machine » présentée par Charly et Lulu.\r\n\r\nTout en restant membre du groupe, B-Jay assura les chœurs pour Piero Battery, lors de l''émission « Jubil Musique » et d''un concert à la Cigale.\r\n\r\nDe 2005 à 2009, il participe au Gospel session au Bizz''art, ou il y fera forte impression.\r\n\r\nJuin 2008, B-Jay entame sa carrière solo et réalise son 1er clip « Oh lèves les mains » diffusé sur plusieurs chaines télévisées telles que Trace TV, MCM ou encore MTV BASE.\r\n\r\nEn Novembre 2008, B-Jay accompagne Christophe Maé en tant que choriste gospel lors de ces concerts au Palais des Sports puis en Mars 2011, c''est aux cotés de Yaël Naïm, élue artiste féminine de l''année qu''il se produit lors des victoires de la musique.\r\n\r\nIl sort son nouveau titre « Cœur d’Un Soldat », un titre r&b produit par Moonlight Music en Septembre 2011.\r\n\r\nB-Jay vous transportera dans son univers musical, mélangeant les rythmes R&b et les sonorités carribeans…', '2013-12-06 11:46:00', 'b-jay', 'bjayofficiel', NULL, ''),
(246, 'Soumia', 'Soumia est une chanteuse franco-marocaine. Elle a déjà 3 albums à son actif produit par kaysha.', '2013-12-06 21:26:00', 'soumia', 'SRsoumia', 'Soumiaofficiel', ''),
(247, 'Apreem', 'Chanteur de dancehall de gwada', '2013-12-06 22:02:00', 'apreem', NULL, 'APREEMstyle', ''),
(249, 'Maani attitude', 'Artiste rap gwada', '2013-12-10 14:11:00', 'maani-attitude', NULL, NULL, ''),
(250, 'Linzy bacbotte', 'Elle est sans conteste la plus belle voix féminine de Maurice. Linzy Bacbotte\r\ndégage à travers ses chansons des émotions vraies dépeignant la réalité\r\npure de son pays. Auteur de divers opus éclectique allant du séga au\r\nreggae en passant par le zouk et de R&B, elle est une artiste ouverte sur le\r\nmonde. Linzy chante des textes engagés et met son talent artistique au service\r\ndu social, en défendant les droits des femmes et des enfants et participe à la\r\nlutte contre le sida.', '2013-12-10 14:18:00', 'linzy-bacbotte', NULL, NULL, ''),
(251, 'Njie', 'Artiste Zouk guadeloupéene que l''on connais depuis 1993 et son fameux "Tempo 106" déjà repris avec succès depuis. Elle enchaine les succes, puis après une longue pause sans nouveau titre, elle nous revient avec des titres tout aussi efficace qu''auparavant.', '2013-12-11 07:35:00', 'njie', 'NJIE.fan.page', 'NJIEALBUM', ''),
(252, 'Rolyat', 'Artiste hip-hop gwada', '2013-12-12 07:38:00', 'rolyat', NULL, NULL, ''),
(253, 'Maqflah', 'Artiste rap gwada', '2013-12-12 12:07:00', 'maqflah', NULL, NULL, ''),
(254, 'Dominik coco', 'Dominik COCO est un artiste connu pour ses succès dans le milieu du zouk avec "Volt face" mais pas seulement, en solo il s''est plutôt orienté vers les racines du pays et les traditions, passant par le gwo ka, la biguine sans oublier le reggae', '2013-12-12 12:12:00', 'dominik-coco', 'DominikCoco.Officiel', NULL, ''),
(255, 'Warren', 'Artiste zouk guyannais', '2013-12-12 19:42:00', 'warren', 'WarrenZouk', 'MusicWarren', ''),
(256, 'Fanny j', 'Fanny J, de son vrai nom Fanny Jacques-André-Coquin, chanteuse de zouk et n''n''b est née le 6 octobre 1987 Guyane.  Elle se découvre une passion pour la musique dès son plus jeune âge et participe à  plusieurs concours de chant. En 2007, elle est repérée par Warren, chanteur, producteur et compositeur guyanais qui lui compose son premier tube "Ancrée à ton port" puis son premier album "Vous les Hommes" qui cartonnera et pour lequel elle fera la promotion en Europe, en Afrique et aux Etats-Unis.\r\n\r\nLa carrière musicale de Fanny J est désormais lancée.\r\n\r\nTrois ans après, son second album intitulé "Secret de Femme", dans lequel la chanteuse s''adonne à de nombreuses collaborations avec d''autres artistes (Black Kent, Admiral T, Krys, Slaï....) entérine son succès en se plaçant en tête des ventes.\r\n\r\nDepuis 2010, Fanny J est l''une des artistes antillaises à avoir fait de plusieurs concerts dans les salles mythiques parisiennes. En 2010, elle s''est produit au Zenith de Paris et en 2012, à l''Olympia.\r\n\r\nToujours à la recherche de nouvelles expériences musicales, Fanny J a récemment participé à la compilation "Tropical Family" dans laquelle elle reprend la chanson des Zouk Machine, "Maldon" en compagnie de Louisy Jospeh et Lynnsha,  qui sera le tube de l''été 2013.', '2013-12-12 19:45:00', 'fanny-j', 'FannyJofficiel', 'OfficielFannyJ', '');

